{'type': 'NarrativeText', 'element_id': '2c70710eba9eddec8c2314975e7d95f9', 'text': 'Allacciamenti elettrici, Allacciamenti idrici, Installazione della macchina, Collaudo della macchina, interventi di riparazione su tutti i componenti e organi della macchina, Smontaggio della macchina e/o dei suoi componenti, Interventi di regolazione e taratura Manutenzione e pulizia della macchina relativa a parti e componenti (elettrici, elettronici, meccanici, frigoriferi)', 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': 'dc97dc63b0cced9f128e764f467b24e3', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'UncategorizedText', 'element_id': '57f2bacdfb1f85499575354c411dad4b', 'text': 'Il presente manuale di istruzione è parte integrante del produttore di ghiaccio e fornisce tutte le indicazioni necessarie per una corretta installazione, un corretto uso e manutenzione della macchina.', 'metadata': {'category_depth': 0, 'emphasized_text_contents': ['Il presente manuale di istruzione è parte integrante del produttore di ghiaccio e fornisce tutte le indicazioni necessarie per una corretta installazione, un corretto uso e manutenzione della macchina.'], 'emphasized_text_tags': ['b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': 'dc97dc63b0cced9f128e764f467b24e3', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'NarrativeText', 'element_id': 'bbc49c718ce0afe1f7b6c5ab27113a79', 'text': 'È obbligatorio, da parte dell’utilizzatore, leggere attentamente il manuale e fare sempre riferimento ad esso per l’utilizzo della macchina. Inoltre deve essere conservato in luogo noto e accessibile a tutti gli operatori autorizzati (installatore, utilizzatore, manutentore).', 'metadata': {'category_depth': 0, 'emphasized_text_contents': ['È obbligatorio, da parte dell’utilizzatore, leggere attentamente il manuale e fare sempre riferimento ad esso per l’utilizzo della macchina. Inoltre deve essere conservato in luogo noto e accessibile a tutti gli operatori autorizzati (installatore, utilizzatore, manutentore).'], 'emphasized_text_tags': ['b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': 'dc97dc63b0cced9f128e764f467b24e3', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'NarrativeText', 'element_id': 'e57c1d86f63b37a929a35b09b4ba70dc', 'text': 'È esclusa qualsiasi responsabilità contrattuale ed extracontrattuale del costruttore per i danni causati da errori nell’installazione e nell’uso, e comunque da inosservanza delle vigenti norme Nazionali e Locali e delle istruzioni date dal costruttore stesso.', 'metadata': {'category_depth': 0, 'emphasized_text_contents': ['È esclusa qualsiasi responsabilità contrattuale ed extracontrattuale del costruttore per i danni causati da errori nell’installazione e nell’uso, e comunque da inosservanza delle vigenti norme Nazionali e Locali e delle istruzioni date dal costruttore stesso.'], 'emphasized_text_tags': ['b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': 'dc97dc63b0cced9f128e764f467b24e3', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'NarrativeText', 'element_id': '8671044147a246f6a3a105c3db7728b5', 'text': 'I\tIl testo evidenziato con questo simbolo è di particolare importanza o segnala potenziale pericolo', 'metadata': {'category_depth': 0, 'emphasized_text_contents': ['Il testo evidenziato con questo simbolo è di particolare importanza o segnala potenziale pericolo'], 'emphasized_text_tags': ['b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': 'dc97dc63b0cced9f128e764f467b24e3', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
