{'type': 'ListItem', 'element_id': '9b1a826b0f4533092a035b45b511f527', 'text': 'ATTENZIONE: Mantenere libere da ostruzioni le aperture di ventilazione nell’involucro dell’apparecchio o nella struttura a incasso.', 'metadata': {'category_depth': 0, 'emphasized_text_contents': ['ATTENZIONE: Mantenere libere da ostruzioni le aperture di ventilazione nell’involucro dell’apparecchio o nella struttura a incasso.'], 'emphasized_text_tags': ['b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': 'af3324b1fb7d48ebe3a27c2ac76a4c3f', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
