{'type': 'ListItem', 'element_id': 'd3ef6946301805a51352e3c9a3f45dd4', 'text': 'Se il cavo di alimentazione è danneggiato, esso deve essere sostituito dal costruttore o dal suo servizio assistenza tecnica o comunque da una persona con qualiﬁca similare, in modo da prevenire ogni rischio.', 'metadata': {'category_depth': 0, 'emphasized_text_contents': ['Se il cavo di alimentazione è danneggiato, esso deve essere sostituito dal costruttore o dal suo servizio assistenza tecnica o comunque da una persona con qualiﬁca similare, in modo da prevenire ogni rischio.'], 'emphasized_text_tags': ['b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '28c4c81803212c3635e1a388e6b7fbbc', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'ListItem', 'element_id': 'a1995650f14f498bb4360611edb2639e', 'text': 'L’apparecchio può essere utilizzato da bambini di età non inferiore a 8 anni e da persone con ridotte capacità ﬁsiche, sensoriali o mentali, o prive di esperienza o della necessaria conoscenza, purché sotto sorveglianza oppure dopo che le stesse abbiano ricevuto istruzioni relative all’uso sicuro dell’apparecchio e alla comprensione dei pericoli ad esso inerenti. La pulizia e la manutenzione destinata ad essere effettuata dall’utilizzatore non deve essere effettuata da bambini senza sorveglianza. I bambini non devono giocare con l’apparecchio.', 'metadata': {'category_depth': 0, 'emphasized_text_contents': ['L’apparecchio può essere utilizzato da bambini di età non inferiore a 8 anni e da persone con ridotte capacità ﬁsiche, sensoriali o mentali, o prive di esperienza o della necessaria conoscenza, purché sotto sorveglianza oppure dopo che le stesse abbiano ricevuto istruzioni relative all’uso sicuro dell’apparecchio e alla comprensione dei pericoli ad esso inerenti. La pulizia e la manutenzione destinata ad essere effettuata dall’utilizzatore non deve essere effettuata da bambini senza sorveglianza. I bambini non devono giocare con l’apparecchio.'], 'emphasized_text_tags': ['b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '28c4c81803212c3635e1a388e6b7fbbc', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'ListItem', 'element_id': 'f27876540f8f0a93a8e79005a47e4947', 'text': 'Il carico e lo scarico dell’apparecchio dal mezzo di trasporto può essere effettuato con un carrello elevatore o transpallets a forche con lunghezza superiore alla metà del mobile. Il mezzo di sollevamento deve essere scelto in base alle dimensioni della macchina/componenti imballati e con portata adeguata.', 'metadata': {'category_depth': 0, 'emphasized_text_contents': ['Il carico e lo scarico dell’apparecchio dal mezzo di trasporto può essere effettuato con un carrello elevatore o transpallets a forche con lunghezza superiore alla metà del mobile. Il mezzo di sollevamento deve essere scelto in base alle dimensioni della macchina/componenti imballati e con portata adeguata.'], 'emphasized_text_tags': ['b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '28c4c81803212c3635e1a388e6b7fbbc', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'ListItem', 'element_id': '191307112667d4ea73fdffd5da7dad48', 'text': 'Per la movimentazione dell’apparecchio devono essere adottate tutte le precauzioni necessarie per non danneggiarlo.', 'metadata': {'category_depth': 0, 'emphasized_text_contents': ['Per la movimentazione dell’apparecchio devono essere adottate tutte le precauzioni necessarie per non danneggiarlo.'], 'emphasized_text_tags': ['b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '28c4c81803212c3635e1a388e6b7fbbc', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'ListItem', 'element_id': '9cd1de5c7e0ccd2eef647151722543d2', 'text': 'Dopo aver tolto l’imballo, assicurarsi dell’integrità della macchina/sottoassiemi. In caso di dubbio non utilizzarlo e rivolgersi al distributore.', 'metadata': {'category_depth': 0, 'emphasized_text_contents': ['Dopo aver tolto l’imballo, assicurarsi dell’integrità della macchina/sottoassiemi. In caso di dubbio non utilizzarlo e rivolgersi al distributore.'], 'emphasized_text_tags': ['b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '28c4c81803212c3635e1a388e6b7fbbc', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'ListItem', 'element_id': 'ab9609520857654b3940404e8538d1df', 'text': 'Tutti i componenti dell’imballo devono essere smaltiti secondo le norme vigenti nel Paese di utilizzo dell’apparecchio. In ogni caso nulla deve essere disperso nell’ambiente.', 'metadata': {'category_depth': 0, 'emphasized_text_contents': ['Tutti i componenti dell’imballo devono essere smaltiti secondo le norme vigenti nel Paese di utilizzo dell’apparecchio. In ogni caso nulla deve essere disperso nell’ambiente.'], 'emphasized_text_tags': ['b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '28c4c81803212c3635e1a388e6b7fbbc', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
