{'type': 'ListItem', 'element_id': '91df735a315b6c589f49d63b8e2222c7', 'text': "Per evitare l'innesco del propano in caso di perdita e la propagazione dell'incendio, evitare di mettere nel raggio di 3 m, fonti di ﬁamma, materiali comburenti o esplosivi , e garantire un ricircolo sufficiente di aria (ﬁg. 19)", 'metadata': {'category_depth': 0, 'emphasized_text_contents': ["Per evitare l'innesco del propano in caso di perdita e la propagazione dell'incendio, evitare di mettere nel raggio di 3 m, fonti di ﬁamma, materiali comburenti o esplosivi , e garantire un ricircolo sufficiente di aria (ﬁg. 19)"], 'emphasized_text_tags': ['b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '4fe85a2ab8d0f6009eeb096f08ca805d', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
