{'type': 'UncategorizedText', 'element_id': '122832dc1df8d9b682326e6adfbd786a', 'text': '! Si declina ogni responsabilità per danni a persone, animali o cose derivanti dalla mancata messa a terra dell’apparecchio e dalla realizzazione di un impianto', 'metadata': {'category_depth': 0, 'emphasized_text_contents': ['Si declina ogni responsabilità per danni a persone, animali o cose derivanti dalla mancata messa a terra dell’apparecchio e dalla realizzazione di un impianto'], 'emphasized_text_tags': ['b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '613f5e859c4806786e5d4c1f43c66a0a', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'NarrativeText', 'element_id': 'c49c2c1a8215865add7b1a4ae0102c00', 'text': 'elettrico non conforme alle norme vigenti.', 'metadata': {'category_depth': 0, 'emphasized_text_contents': ['elettrico non conforme alle norme vigenti.'], 'emphasized_text_tags': ['b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '613f5e859c4806786e5d4c1f43c66a0a', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'NarrativeText', 'element_id': '0c6c6a04d4aca70b896d4b514afeeb66', 'text': 'Installare nell’impianto di alimentazione un dispositivo per la disconnessione dalla rete di alimentazione omnipolare che fornisca piena disconnessione sotto condizioni di sovratensione di categoria III in accordo alle norme vigenti. Il collegamento alla rete elettrica deve essere effettuato secondo le norme nazionali vigenti e da personale qualificato e abilitato.', 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '613f5e859c4806786e5d4c1f43c66a0a', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'NarrativeText', 'element_id': '4568be1cc87f3e9087e0b26c6755b5a1', 'text': 'Prima di collegare l’apparecchio alla rete elettrica assicurarsi che la tensione di rete corrisponda a quella indicata in targa (Fig. 10).', 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '613f5e859c4806786e5d4c1f43c66a0a', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'UncategorizedText', 'element_id': 'e271704ec003b1b783623b279d134e10', 'text': 'Verificare che l’impianto elettrico sia adeguato alla poten- za massima assorbita dell’apparecchio indicata in targa.', 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '613f5e859c4806786e5d4c1f43c66a0a', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'NarrativeText', 'element_id': '4da0653b5e07da035c496cc333945cff', 'text': 'Nei casi in cui il cavo di alimentazione elettrica dell’apparecchio risultasse danneggiato, esso dovrà essere sostituito con un altro di caratteristiche conformi alle norme vigenti nel paese di installazione ed effettuato da personale qualificato in modo da prevenire qualsiasi rischio alle persone.', 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '613f5e859c4806786e5d4c1f43c66a0a', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'NarrativeText', 'element_id': '28bcb58d6239de44a7d888f080f5d1a6', 'text': 'Il conduttore di terra deve essere collegato correttamente', 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '613f5e859c4806786e5d4c1f43c66a0a', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'Title', 'element_id': 'd16e94aa858726a362558b40711060d3', 'text': 'ad un efficiente impianto di messa a terra.', 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'NarrativeText', 'element_id': 'b743ebdebf8a1b28163bdc900d2bf6e7', 'text': 'La ditta costruttrice declina ogni responsabilità ed ogni obbligo di garanzia, qualora si verifichino danni alle apparecchiature, alle persone ed alle cose, imputabili ad una installazione non corretta e/o non rispettosa delle leggi vigenti', 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': 'd16e94aa858726a362558b40711060d3', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'ListItem', 'element_id': 'f2e2bb31d1b199ddd59fed5937246204', 'text': 'MESSA IN FUNZIONE', 'metadata': {'category_depth': 0, 'emphasized_text_contents': ['MESSA IN FUNZIONE'], 'emphasized_text_tags': ['b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': 'd16e94aa858726a362558b40711060d3', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'Title', 'element_id': '2d181ad646b1b61e9d705f4647be1154', 'text': '1 Prendere visione delle figure illustrative:', 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'NarrativeText', 'element_id': 'a9274abad5f5813c978072a2f56e5319', 'text': 'Togliere il coperchio previa rimozione delle viti di fissaggio. Sbloccare il motoriduttore, le palette ed il galleggiante (dove presente) togliendo gli arresti applicati in fabbrica per evitare danni durante il trasporto (fig. 9).', 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '2d181ad646b1b61e9d705f4647be1154', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'UncategorizedText', 'element_id': '8170a76c3d736c89b8526cbd59ab5794', 'text': "Nelle versioni con raffreddamento ad acqua collegare il secondo raccordo che convoglia l'acqua proveniente dal condensatore.", 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '2d181ad646b1b61e9d705f4647be1154', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'NarrativeText', 'element_id': '89eff1a56e23a646f05d4fc9b02e2961', 'text': 'i Nota: Per un perfetto deflusso dell’acqua dall’apparecchio prevedere una pendenza minima del 3% della tubazione controllando che la stessa non subisca strozzature o sifonamenti. È opportuno che la tubazione scarichi in un sifone aperto (fig.7).', 'metadata': {'category_depth': 0, 'emphasized_text_contents': ['Nota:'], 'emphasized_text_tags': ['b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '2d181ad646b1b61e9d705f4647be1154', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'NarrativeText', 'element_id': '261cd565dcec85baafb0565c1a350764', 'text': 'I Prima di collegare la macchina elettricamente, accertarsi che il voltaggio di rete corrisponda a quello indicato sulla targhetta d’immatricolazione posta sullo schienale dell’apparecchio (fig. 10).', 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '2d181ad646b1b61e9d705f4647be1154', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'NarrativeText', 'element_id': '14cc343af92c9e2ea191fe171554a7e2', 'text': 'I La massima tolleranza consentita sulla variazione di tensione è di ± 10% del valore nominale.', 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '2d181ad646b1b61e9d705f4647be1154', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'NarrativeText', 'element_id': 'd85f7f3b9a0ca0ac4c7b93ed5150e40f', 'text': 'Prevedere un circuito di alimentazione elettrica alla macchina con un proprio interruttore generale omnipolare e tale da garantire una distanza di apertura dei contatti che consenta la disconnessione completa nelle condizioni del- la categoria di sovratensione III.', 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '2d181ad646b1b61e9d705f4647be1154', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'NarrativeText', 'element_id': 'd680f59f09575bf5e05f223b90a1151d', 'text': 'I Dimensionare il circuito secondo l’amperaggio indicato sulla targhetta d’immatricolazione (fig.10). La presa elettrica dovrà essere facilmente accessibile', 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '2d181ad646b1b61e9d705f4647be1154', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'NarrativeText', 'element_id': '1c4528a11d96b3957bab622a5955ea9c', 'text': "Una volta verificato il corretto collegamento alla rete id- rica e alla rete elettrica, aprire il rubinetto di alimentazione dell'acqua e inserire la spina nella presa elettrica.", 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '2d181ad646b1b61e9d705f4647be1154', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'NarrativeText', 'element_id': '3b364a9f0e55fa9351d05c5fa1edc914', 'text': 'Se la macchina è in stand-by il pulsante luminoso lampeggerà ogni 30". Per uscire dallo stand-by e avviare definitivamente la macchina toccare l\'interruttore luminoso per almeno 3 secondi, fino a che non viene segnalato con un beep prolungato l\'avvio della macchina (fig.11).', 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '2d181ad646b1b61e9d705f4647be1154', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'NarrativeText', 'element_id': '878f068f4f56e92bcfd6713dc9e9780a', 'text': 'E consigliabile non utilizzare i primi 5 cicli di ghiaccio.', 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '2d181ad646b1b61e9d705f4647be1154', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'NarrativeText', 'element_id': '46b789187c8899bcb9b354175d5d901b', 'text': "Il produttore di ghiaccio è dotato di una sonda di temperatura presente nel deposito del ghiaccio (fig.18), che consente l'arresto della macchina e della produzione di ghiaccio quando il bulbo viene a contatto con il ghiaccio accumulato nel deposito.", 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '2d181ad646b1b61e9d705f4647be1154', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'NarrativeText', 'element_id': '0b6ba7880edc2040c1453f7433e070fb', 'text': "Non chiudere mai l'acqua con macchina in funzione, ne", 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '2d181ad646b1b61e9d705f4647be1154', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'NarrativeText', 'element_id': 'fac64da6939921762a2e2356ffbd8355', 'text': "ostruire le prese di aspirazione dell'aria", 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '2d181ad646b1b61e9d705f4647be1154', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'NarrativeText', 'element_id': 'f816c2d573f20a71e2bdc99674474e15', 'text': 'Nota: Dopo i prelievi liberare il bulbo di controllo da eventuali residui di ghiaccio per una più celere ripresa della produzione (fig.18).', 'metadata': {'category_depth': 0, 'emphasized_text_contents': ['Nota:', 'Nota:'], 'emphasized_text_tags': ['b', 'i'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '2d181ad646b1b61e9d705f4647be1154', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'NarrativeText', 'element_id': '261cd565dcec85baafb0565c1a350764', 'text': 'I Prima di collegare la macchina elettricamente, accertarsi che il voltaggio di rete corrisponda a quello indicato sulla targhetta d’immatricolazione posta sullo schienale dell’apparecchio (fig. 10).', 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '2d181ad646b1b61e9d705f4647be1154', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'ListItem', 'element_id': 'f0706a6d35a353fcb68952f70a6834eb', 'text': 'Controllare che l’acqua arrivi alla vaschetta, che il sen- sore e/o il galleggiante arresti l’entrata prima del trabocco e che non esistano perdite nell’impianto e nei condotti idrici. Il normale livello d’acqua all’interno della vaschetta è a circa 5/10 mm dai bordi superiori. (fig. 12).La regolazione del livello acqua può avvenire ruotando il micro galleggiante o il sensore acqua sull’apposita feritoia prevista sul supporto relativo, previo allentamento della vite di fissaggio 1 (fig. 12). Tale regolazione deve avvenire con alimentazione elettrica disinserita.', 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '2d181ad646b1b61e9d705f4647be1154', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'ListItem', 'element_id': 'd876773db279128bce93e1ab5c5aed69', 'text': 'Verificare che non si producano vibrazioni anormali a', 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '2d181ad646b1b61e9d705f4647be1154', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'Title', 'element_id': 'd3548d0662d7d190840723290bfb681c', 'text': 'causa di viteria allentata.', 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'ListItem', 'element_id': '106cd88f78f26b1f6418c292dca08442', 'text': 'Nel caso di necessità di intervento per perdite d’acqua, serraggio viteria od altro, arrestare sempre prima il produttore.', 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': 'd3548d0662d7d190840723290bfb681c', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'ListItem', 'element_id': '6182fac56462dbc1f3b9533964c1f9d3', 'text': 'Controllare un ciclo di produzione ghiaccio verificando', 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': 'd3548d0662d7d190840723290bfb681c', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'NarrativeText', 'element_id': 'd1f0f12a544c68e42f42c1b19e82e7b3', 'text': 'che i cubetti vengano scaricati nel deposito.', 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': 'd3548d0662d7d190840723290bfb681c', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'ListItem', 'element_id': 'f348bba941eaca0b443896459679b731', 'text': 'Verificare la funzionalità della sonda deposito (fig. 18): appoggiando un cubetto di ghiaccio sul bulbo all’interno del contenitore il produttore dovrebbe arrestarsi entro 1 minuto e ripartire automaticamente dopo averlo tolto, in tempo poco superiore.', 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': 'd3548d0662d7d190840723290bfb681c', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'ListItem', 'element_id': '8dcc8288ca638f9f45cb28296a1e96e3', 'text': 'Rimontare il coperchio tolto in precedenza.', 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': 'd3548d0662d7d190840723290bfb681c', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'ListItem', 'element_id': '0c4fb3b7a7684b6c4676a0c25d5ff14e', 'text': 'Regolazione Sonda Deposito', 'metadata': {'category_depth': 1, 'emphasized_text_contents': ['Regolazione Sonda Deposito'], 'emphasized_text_tags': ['b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '8dcc8288ca638f9f45cb28296a1e96e3', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'NarrativeText', 'element_id': '74a1855630167f8293c381ad638f7610', 'text': 'Nel tempo, a causa della variazione della temperatura ambiente, il set della sonda deposito, che arresta la produzione, può non essere sufficiente. Per regolare tale valore seguire la seguente procedura:', 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': 'd3548d0662d7d190840723290bfb681c', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'ListItem', 'element_id': '29853d3aeecb8e3c0b50a80c95fd910c', 'text': 'Toccare, in stand-by, il tasto (Fig.11) per 3 volte entro', 'metadata': {'category_depth': 0, 'emphasized_text_contents': ['in stand-by', '3 volte entro'], 'emphasized_text_tags': ['b', 'b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': 'd3548d0662d7d190840723290bfb681c', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'Title', 'element_id': '7c8380602f753cfb5cde1b8ef7fc81ec', 'text': '2 secondi, il tasto assumerà una colorazione tra il bianco', 'metadata': {'category_depth': 0, 'emphasized_text_contents': ['2 secondi'], 'emphasized_text_tags': ['b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'Title', 'element_id': 'dbbfc930161ffd2fcbbc383b6ab36812', 'text': 'e il rosso.', 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'ListItem', 'element_id': 'c53181f64593280b5c291521b223f610', 'text': 'Per aumentare la T° di set, toccare il pulsante (Fig.11) cercando di aumentare la colorazione rossa, mentre per diminuirla premere fino a virare verso il bianco. Dopo 5 secondi di assenza di pressione salva ed esce dalla fase di modifica.', 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': 'dbbfc930161ffd2fcbbc383b6ab36812', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'ListItem', 'element_id': '2331771d7964de985e28d3ab6634b4bd', 'text': 'PULIZIA E MANUTENZIONE', 'metadata': {'category_depth': 0, 'emphasized_text_contents': ['PULIZIA E MANUTENZIONE'], 'emphasized_text_tags': ['b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': 'dbbfc930161ffd2fcbbc383b6ab36812', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'NarrativeText', 'element_id': 'a26559e7881c71c98db3fee5e1632ca8', 'text': 'Prima di effettuare operazioni di pulizia o di manutenzione, scollegare la macchina dalla rete di alimentazione elettrica azionando l’interruttore generale e staccando la spina.', 'metadata': {'category_depth': 0, 'emphasized_text_contents': ['Prima di effettuare operazioni di pulizia o di manutenzione, scollegare la macchina dalla rete di alimentazione elettrica azionando l’interruttore generale e staccando la spina.'], 'emphasized_text_tags': ['b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': 'dbbfc930161ffd2fcbbc383b6ab36812', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'NarrativeText', 'element_id': 'b2c8eb9c5c914b2fc7896d6802ed2a59', 'text': 'Se la presa è ad una distanza o posizione non controllabile dall’operatore oppure l’apparecchio è sprovvisto di spina, deve essere installato un dispositivo per la disconnessione elettrica lucchettabile onde evitare la connessione accidentale dell’apparecchio', 'metadata': {'category_depth': 0, 'emphasized_text_contents': ['Se la presa è ad una distanza o posizione non controllabile dall’operatore oppure l’apparecchio è sprovvisto di spina, deve essere installato un dispositivo per la disconnessione elettrica lucchettabile onde evitare la connessione accidentale dell’apparecchio'], 'emphasized_text_tags': ['b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': 'dbbfc930161ffd2fcbbc383b6ab36812', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'ListItem', 'element_id': 'ffc9e846e0e4b936c8e9026caa69d5b1', 'text': 'Operazioni a cura dell’utilizzatore', 'metadata': {'category_depth': 1, 'emphasized_text_contents': ['Operazioni a cura dell’utilizzatore'], 'emphasized_text_tags': ['b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': 'dbbfc930161ffd2fcbbc383b6ab36812', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'ListItem', 'element_id': 'd928af377b208f44731b57abc698b301', 'text': 'Pulizia scocca esterna', 'metadata': {'category_depth': 2, 'emphasized_text_contents': ['Pulizia scocca esterna'], 'emphasized_text_tags': ['b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': 'ffc9e846e0e4b936c8e9026caa69d5b1', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'ListItem', 'element_id': '85045e55bd11e96f4a7cb0d55a5d55b7', 'text': 'per la pulizia della carrozzeria, é sufficiente usare un panno inumidito con un prodotto specifico, privo di cloro, per acciaio inossidabile.', 'metadata': {'category_depth': 3, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': 'd928af377b208f44731b57abc698b301', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'ListItem', 'element_id': 'efd89c979263af19ceea0a55a4b02b71', 'text': 'Pulizia contenitore ghiaccio', 'metadata': {'category_depth': 2, 'emphasized_text_contents': ['Pulizia contenitore ghiaccio'], 'emphasized_text_tags': ['b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': 'ffc9e846e0e4b936c8e9026caa69d5b1', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'ListItem', 'element_id': '5f326160eefd2f665d3367bd06fa5a38', 'text': 'Estrarre il ghiaccio dal deposito. Pulire l’interno con una spugna inumidita in acqua tiepida unita ad un poco di bi- carbonato di sodio;', 'metadata': {'category_depth': 3, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': 'efd89c979263af19ceea0a55a4b02b71', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'ListItem', 'element_id': 'b716a9fd7bf9289c5db70ab568c440f8', 'text': 'sciacquare con acqua pura ed asciugare accuratamente.', 'metadata': {'category_depth': 3, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': 'efd89c979263af19ceea0a55a4b02b71', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'ListItem', 'element_id': '8595885935e2a031cb8d4beb1cf3a2b5', 'text': 'Operazioni a cura dell’installatore abili- tato', 'metadata': {'category_depth': 1, 'emphasized_text_contents': ['Operazioni a cura dell’installatore abili- tato'], 'emphasized_text_tags': ['b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': 'dbbfc930161ffd2fcbbc383b6ab36812', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'NarrativeText', 'element_id': 'd491de2a3b0dd619766d58a82ffe1427', 'text': 'Di seguito elenchiamo le operazioni di manutenzione ordinaria che devono essere eseguite solamente da tecnici installatori abilitati. La ditta costruttrice declina ogni responsabilità per incidenti causati dall’inadempienza del suddetto obbligo.', 'metadata': {'category_depth': 0, 'emphasized_text_contents': ['Di seguito elenchiamo le operazioni di manutenzione ordinaria che devono essere eseguite solamente da tecnici installatori abilitati. La ditta costruttrice declina ogni responsabilità per incidenti causati dall’inadempienza del suddetto obbligo.'], 'emphasized_text_tags': ['b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': 'dbbfc930161ffd2fcbbc383b6ab36812', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'ListItem', 'element_id': '2d739efdbd1402d168fbc5663fbc2f29', 'text': 'Pulizia condensatore ad aria (se presente) Per valorizzare al meglio il vostro produttore in termini di resa e durata è necessario effettuare periodicamente la pulizia del condensatore ad aria e del suo filtro posizionato nella parte frontale del produttore (vedi fig.13-16).', 'metadata': {'category_depth': 2, 'emphasized_text_contents': ['Pulizia condensatore ad aria (se presente)'], 'emphasized_text_tags': ['b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': 'dbbfc930161ffd2fcbbc383b6ab36812', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'NarrativeText', 'element_id': '2c9a454b6369c1dbc875a702dd7b1743', 'text': 'Non utilizzare spazzole o oggetti contundenti per la pulizia del condensatore.', 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': 'dbbfc930161ffd2fcbbc383b6ab36812', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'ListItem', 'element_id': 'ee82ef2eea693aa6b02dde81d390e442', 'text': 'Pulizia ﬁltro entrata acqua', 'metadata': {'category_depth': 2, 'emphasized_text_contents': ['Pulizia ﬁltro entrata acqua'], 'emphasized_text_tags': ['b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': 'dbbfc930161ffd2fcbbc383b6ab36812', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'NarrativeText', 'element_id': 'cd2fbc09b1513a178133ce156636168c', 'text': 'Chiudere il rubinetto d’intercettazione d’acqua all’apparecchio, staccare il tubo entrata acqua e sfilare con una pinza la retina filtrante situata sull’elettrovalvola entrata acqua.', 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': 'dbbfc930161ffd2fcbbc383b6ab36812', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'NarrativeText', 'element_id': 'fff10b1502e389dfb2a91ad88a304b14', 'text': 'Pulire la retina con getto d’acqua e rimontarla nella propria sede.', 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': 'dbbfc930161ffd2fcbbc383b6ab36812', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'ListItem', 'element_id': 'f5652dcbfd769f16868034df7e094ba1', 'text': 'Attivazione Ozono (optional)', 'metadata': {'category_depth': 1, 'emphasized_text_contents': ['Attivazione Ozono (optional)'], 'emphasized_text_tags': ['b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': 'dbbfc930161ffd2fcbbc383b6ab36812', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'UncategorizedText', 'element_id': 'dd1d08815df28bcd644b901d00ac9e77', 'text': 'Nel caso sia installato il generatore di ozono, esso si attiva periodicamente con la seguente sequenza: 5 ore non attivo , 1 ora attivo.', 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': 'dbbfc930161ffd2fcbbc383b6ab36812', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'NarrativeText', 'element_id': 'fa6df16ae488c633fed3ce27af5dfa82', 'text': 'La sequenza è sincronizzata con la prima alimentazione della macchina (power-ON).', 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': 'dbbfc930161ffd2fcbbc383b6ab36812', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'ListItem', 'element_id': 'd34e46d5499f4bbe4dc188a12f4669f0', 'text': 'Ciclo di lavaggio e saniﬁcazione', 'metadata': {'category_depth': 1, 'emphasized_text_contents': ['Ciclo di lavaggio e saniﬁcazione'], 'emphasized_text_tags': ['b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': 'dbbfc930161ffd2fcbbc383b6ab36812', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'NarrativeText', 'element_id': 'd6b900d265b226421cd8561e0bc4444d', 'text': 'Per ovviare ai problemi dati dalla durezza dell’acqua di alimentazione e quindi la formazione di impurità sulle parti e componenti a contatto con l’acqua, la macchina e’ stata dotata di una funzione “self Cleaning”. Tale funzione, grazie all’azione pulente di un prodotto specifico, una bustina di prodotto in polvere e la bottiglia dosatrice, permette di mantenere pulita e igienizzata la macchina dal calcare e', 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': 'dbbfc930161ffd2fcbbc383b6ab36812', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'Title', 'element_id': '942f7ced95e81ace2753b141910e0800', 'text': 'dalle incrostazioni.', 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'NarrativeText', 'element_id': 'ae5475a1575e3100030eb6bebd66c927', 'text': 'Per garantite una buona pulizia del fabbricatore di ghiaccio si consiglia di eseguire il ciclo di lavaggio almeno 3-4 volte all’anno in funzione della durezza dell’acqua di alimentazione.', 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '942f7ced95e81ace2753b141910e0800', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'Title', 'element_id': '29e9f86c6636a814a73f138e83e540cc', 'text': 'Kit lavaggio (optional)', 'metadata': {'category_depth': 0, 'emphasized_text_contents': ['Kit lavaggio (optional)', 'Kit lavaggio (optional)'], 'emphasized_text_tags': ['b', 'i'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'NarrativeText', 'element_id': 'adbbc51373fddd943ab8da64d5319db2', 'text': 'Il kit è composto da una bottiglia in plastica con tubo in gomma, una confezione di acido citrico da 1 kg. e le istruzioni per il ciclo di lavaggio.', 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '29e9f86c6636a814a73f138e83e540cc', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'Table', 'element_id': '0adae49a86f8e59664b78a684aa83aec', 'text': 'Quantitativi di acido citrico da miscelare con aqua nella bottiglia per ottenere la miscela MODELLO Quantità Acido Citrico 20 - 25 Kg 200 g 30 - 40 Kg 250 g 50 Kg 350 g 70 - 90 Kg 500 g', 'metadata': {'last_modified': '2024-03-04T08:54:58', 'text_as_html': '<table>\n<thead>\n<tr><th>Quantitativi di acido citrico da miscelare con aqua nella bottiglia per ottenere la miscela  </th><th>Quantitativi di acido citrico da miscelare con aqua nella bottiglia per ottenere la miscela  </th></tr>\n</thead>\n<tbody>\n<tr><td>MODELLO                                                                                      </td><td>Quantità Acido Citrico                                                                       </td></tr>\n<tr><td>20 - 25 Kg                                                                                   </td><td>200 g                                                                                        </td></tr>\n<tr><td>30 - 40 Kg                                                                                   </td><td>250 g                                                                                        </td></tr>\n<tr><td>50 Kg                                                                                        </td><td>350 g                                                                                        </td></tr>\n<tr><td>70 - 90 Kg                                                                                   </td><td>500 g                                                                                        </td></tr>\n</tbody>\n</table>', 'languages': ['ita'], 'parent_id': '29e9f86c6636a814a73f138e83e540cc', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'NarrativeText', 'element_id': '3dc4f21cad655ea6bcee3cc3fd2ceeeb', 'text': 'nl Prendere le dovute precauzioni nel maneggiare l’acido citrico mentre si prepara la', 'metadata': {'category_depth': 0, 'emphasized_text_contents': ['Prendere le dovute precauzioni nel maneggiare l’acido citrico mentre si prepara la'], 'emphasized_text_tags': ['b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '29e9f86c6636a814a73f138e83e540cc', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'Title', 'element_id': '4ed9f185463032b84cc57300591f844d', 'text': 'soluzione (acqua più acido citrico, vedi tabella) indossando guanti e occhiali protettivi.', 'metadata': {'category_depth': 0, 'emphasized_text_contents': ['soluzione (acqua più acido citrico, vedi tabella) indossando guanti e occhiali protettivi.'], 'emphasized_text_tags': ['b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'UncategorizedText', 'element_id': 'a83dd0ccbffe39d071cc317ddf6e97f5', 'text': 'I', 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '4ed9f185463032b84cc57300591f844d', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'NarrativeText', 'element_id': '2ba45a9d190fd21a4174091e82d0869e', 'text': 'In caso di avvio accidentale di un ciclo lavaggio (pressione tasto >9"), per uscire dalla procedura ci sono due possibilità:', 'metadata': {'category_depth': 0, 'emphasized_text_contents': ['In caso di', 'avvio accidentale', 'di un ciclo lavaggio (pressione tasto >9"), per uscire dalla procedura ci sono due possibilità:'], 'emphasized_text_tags': ['b', 'b', 'b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '4ed9f185463032b84cc57300591f844d', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'ListItem', 'element_id': 'dd0225cfdee7159990e90b91f66c63b1', 'text': 'dopo circa 1h40\' premendo il tasto 3" si riporta la macchina in stand by, e dopo premendo un\'altra volta 3" si avvia il ciclo di produzione.', 'metadata': {'category_depth': 0, 'emphasized_text_contents': ['dopo circa 1h40\' premendo il tasto 3" si riporta la macchina in stand by, e dopo premendo un\'altra volta 3" si avvia il ciclo di produzione.'], 'emphasized_text_tags': ['b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '4ed9f185463032b84cc57300591f844d', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'ListItem', 'element_id': '4666f72e3d7734a8791af790de7a54d5', 'text': 'dopo 2h 30\' la macchina si porta automaticamente in stand by, e da qui è possibile avviare il ciclo produzione premendo il tasto 3"', 'metadata': {'category_depth': 0, 'emphasized_text_contents': ['dopo 2h 30\' la macchina si porta automaticamente in stand by, e da qui è possibile avviare il ciclo produzione premendo il tasto 3"'], 'emphasized_text_tags': ['b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '4ed9f185463032b84cc57300591f844d', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'UncategorizedText', 'element_id': 'bb0c55088d92330187e9c214ecbf6de5', 'text': '1. Spegnere la macchina,', 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '4ed9f185463032b84cc57300591f844d', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'NarrativeText', 'element_id': '6ae6f1e8dad916ef75215ca6fd174d6e', 'text': '2. Togliere tutto il ghiaccio dal contenitore.', 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '4ed9f185463032b84cc57300591f844d', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'NarrativeText', 'element_id': '2528787b5cfd25b2f3fb0e079fdd37ae', 'text': '3. Servendosi del prodotto specifico e della bottiglia in plastica, preparare la soluzione sciogliendo la polvere in acqua tiepida (max. 40°C) secondo le quantità riportate nella tabella allegata. Mescolare il tutto facendo attenzione che non si verifichino dei grumi.', 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '4ed9f185463032b84cc57300591f844d', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'NarrativeText', 'element_id': '9a8be5293a87994ec1b43b59027ca52a', 'text': '4. Versare il prodotto di lavaggio nella vaschetta evaporatore, introducendo la cannula della bottiglia in tutta la sua lunghezza nell’apposito foro (fig. 14) e scaricare tutta la miscela precedentemente preparata, facendo pressione con le mani sulla bottiglia.', 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '4ed9f185463032b84cc57300591f844d', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'UncategorizedText', 'element_id': 'fa1521e9e6512e49485b861f1c1f725a', 'text': '5. Riaccendere la macchina, e se non lo è già , metterla nello stato di stand-by (fig.11).', 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '4ed9f185463032b84cc57300591f844d', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'NarrativeText', 'element_id': 'a86e813d6ed455fba6d6d245f9a22554', 'text': '6. Premere per almeno 9" il tasto di stand-by per avviare il ciclo di lavaggio', 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '4ed9f185463032b84cc57300591f844d', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'UncategorizedText', 'element_id': '3f47b22badbe9bf45506841d24f83f1f', 'text': '7. Durante il ciclo di lavaggio il tasto lampeggerà nel modo seguente: spento per 1 secondo e acceso (bianco) per 3 secondi, una volta terminato il lavaggio, si porterà in stand-by.', 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '4ed9f185463032b84cc57300591f844d', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'UncategorizedText', 'element_id': '0540ff116efa6b99e36880083d31540b', 'text': "8. Ripetere l'operazione di lavaggio senza aggiungere l'acido citrico, per eliminare la presenza del decalcificante e igienizzante.", 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '4ed9f185463032b84cc57300591f844d', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'Title', 'element_id': '1e3a93dcb39b626d3e95c9a2b041226c', 'text': '9. Dopo tale periodo spegnere le macchina, pulirla e poi', 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'Title', 'element_id': 'b4b0376eaced9609e16cbdabc6e6cf3d', 'text': 'asciugarla internamente.', 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'NarrativeText', 'element_id': '7add4cf9f222844f1201ac528400df5a', 'text': 'I Se l’apparecchio dovesse rimanere inutilizzato per lunghi periodi:', 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': 'b4b0376eaced9609e16cbdabc6e6cf3d', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'ListItem', 'element_id': 'e14df9641e6b05521592c8c0d4d67245', 'text': 'disattivare la macchina;', 'metadata': {'category_depth': 1, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': 'b4b0376eaced9609e16cbdabc6e6cf3d', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'ListItem', 'element_id': '440f8e99ee17f1d811bdea55e45a0696', 'text': 'togliere tutto il ghiaccio dal contenitore;', 'metadata': {'category_depth': 1, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': 'b4b0376eaced9609e16cbdabc6e6cf3d', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'ListItem', 'element_id': 'e1af5c620b9d6d1e6bda70ddd87fed12', 'text': 'scaricare tutta l’acqua;', 'metadata': {'category_depth': 1, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': 'b4b0376eaced9609e16cbdabc6e6cf3d', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'ListItem', 'element_id': '55ab209ad7babd517efb53cef5ebb215', 'text': 'eseguire un’accurata pulizia;', 'metadata': {'category_depth': 1, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': 'b4b0376eaced9609e16cbdabc6e6cf3d', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'ListItem', 'element_id': 'eb2b434bb76364af8e17b91a3f559130', 'text': 'lasciare lo sportello del contenitore leggermente aperto', 'metadata': {'category_depth': 1, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': 'b4b0376eaced9609e16cbdabc6e6cf3d', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'ListItem', 'element_id': '2bb90218ec76f5b41abe82e77d56afce', 'text': 'MALFUNZIONAMENTO', 'metadata': {'category_depth': 0, 'emphasized_text_contents': ['MALFUNZIONAMENTO'], 'emphasized_text_tags': ['b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': 'b4b0376eaced9609e16cbdabc6e6cf3d', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'Title', 'element_id': '768a8053ce633b2409c1f62ea5aea693', 'text': '1 LE SEGUENTI OPERAZIONI DEVONO ESSERE EFFETTUATE ESCLUSIVAMENTE DA INSTALLATORE PATENTATO E AUTORIZZATO.', 'metadata': {'category_depth': 5, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': 'b4b0376eaced9609e16cbdabc6e6cf3d', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'Title', 'element_id': 'c3f46d36de13fe6fe919f5a5a2137202', 'text': "IIN CASO DI NON CORRETTO FUNZIONAMENTO E' CONSIGLIABILE SCONNETTERE LA MACCHINA DALLA ALIMENTAZIONE ELETTRICA E IDRICA.", 'metadata': {'category_depth': 5, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': 'b4b0376eaced9609e16cbdabc6e6cf3d', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'NarrativeText', 'element_id': '1aecd99ffdf6e74d89de8c3a835e2e2d', 'text': '1. Controllare che il rubinetto della rete idrica di alimentazione sia aperto,', 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': 'c3f46d36de13fe6fe919f5a5a2137202', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'ListItem', 'element_id': '7333c6f89afa3eff73194b83f41efcc8', 'text': "Che non manchi l'alimentazione elettrica, che la spina sia inserita correttamente, e l'interruttore sia acceso,", 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': 'c3f46d36de13fe6fe919f5a5a2137202', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'ListItem', 'element_id': 'd876773db279128bce93e1ab5c5aed69', 'text': 'Verificare che non si producano vibrazioni anormali a', 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': 'c3f46d36de13fe6fe919f5a5a2137202', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'Title', 'element_id': 'd3548d0662d7d190840723290bfb681c', 'text': 'causa di viteria allentata.', 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'ListItem', 'element_id': 'fc4f65aa602ab0e9e7853c1b2d101b45', 'text': 'Nel caso di necessità di intervento per perdite d’acqua, serraggio viteria od altro, arrestare sempre prima il produttore, e verificare che la perdita non sia dovuta a ostruzioni delle vie di scarico.', 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': 'd3548d0662d7d190840723290bfb681c', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'ListItem', 'element_id': 'cd4113b484ee3b592b789bdfd9e76cae', 'text': 'In caso di produzione insufficiente, verificare la pulizia del condensatore, o la presenza di perdite di gas refrigerante.', 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': 'd3548d0662d7d190840723290bfb681c', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'ListItem', 'element_id': '55047fb4b689a608c886d9b01d5e1300', 'text': 'Verificare la funzionalità della sonda deposito: appoggiando del ghiaccio sul bulbo all’interno del contenitore il produttore (fig.18) dovrebbe arrestarsi entro 1 minuto e ripartire automaticamente dopo averlo tolto, in tempo poco superiore.', 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': 'd3548d0662d7d190840723290bfb681c', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'ListItem', 'element_id': 'adba19e49041a09fe2da225ec8838997', 'text': 'Tra estate e inverno la sonda deposito, può far variare la quantità di ghiaccio massima nel deposito, per eventuali regolazioni vedi paragrafo 4.1.', 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': 'd3548d0662d7d190840723290bfb681c', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'ListItem', 'element_id': '2d874a6fd5331dab5d9220726bb68a88', 'text': 'LISTA ALLARMI', 'metadata': {'category_depth': 0, 'emphasized_text_contents': ['LISTA ALLARMI'], 'emphasized_text_tags': ['b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': 'd3548d0662d7d190840723290bfb681c', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'Title', 'element_id': '768a8053ce633b2409c1f62ea5aea693', 'text': '1 LE SEGUENTI OPERAZIONI DEVONO ESSERE EFFETTUATE ESCLUSIVAMENTE DA INSTALLATORE PATENTATO E AUTORIZZATO.', 'metadata': {'category_depth': 5, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': 'd3548d0662d7d190840723290bfb681c', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'Title', 'element_id': '11ce6f88f40e0741e4bb8728f00c7979', 'text': "I IN CASO DI NON CORRETTO FUNZIONAMENTO E' CONSIGLIABILE SCONNETTERE LA MACCHINA DALLA ALIMENTAZIONE ELETTRICA E IDRICA.", 'metadata': {'category_depth': 5, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': 'd3548d0662d7d190840723290bfb681c', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'UncategorizedText', 'element_id': '4c1563f3016bc179598ed8353bdeacf4', 'text': 'Il tasto illuminato, ha una combinazione di colorazioni bianche e rosse, che indicano lo stato di funzionamento o di allarme,', 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '11ce6f88f40e0741e4bb8728f00c7979', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'Title', 'element_id': 'c9589367264ee5bb3a24aa48b6563cd8', 'text': 'le riepiloghiamo di seguito:', 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'Table', 'element_id': '7065a3cb311847c31be14c69bcdb29d3', 'text': 'Segnalazione / Allarme ROSSO BIANCO (AL01) Allarme ciclo freddo troppo lungo 1 x 0,5" 1 x 3,0" (AL02) Allarme differenza durata cicli freddi 2 x 0,5" 1 x 3,0" (AL03) Allarme mancanza acqua (se presente sensore) 1 x 3,0" 1 x 0,5" (AL04) Allarme sonda deposito ghiaccio difettosa 3 x 0,5" 1 x 3,0" (AL05) Richiesta manutenzione periodica ON 3" ON 3" (AL06) Alta temperatura uscita condensatore ON OFF (AL07) Allarme Sonda condensatore 4 x 0,5" 1 x 3,0" (AL08) Sonda evaporatore (se presente) 5 x 0,5" 1 x 3,0" (AL09) Blackout - Mancanza alimentazione elettrica OFF x 1,0" 1 x 5,0" (AL10) Allarme alta Pressione ON OFF (AL11) Allarme Pompa scarico 1 x 0,5" 1 x 0,5" (AL12) Allarme sbrinamento lungo 6 x 0,5" 1 x 3,0 " (AL14) Pulizia condensatore 7 x 0,5" 1 x 3,0" (AL15) Inversione sonde 5 x 0,5" 2 x 0,5" (AL17) Alta T� Evaporatore 1 x 3,0" 2 x 0,5" Scaricamento dati HACCP e aggiornamento SW 3 Lamp 3 Lamp Fase avvio macchina OFF Lamp 2Hz Fase produzione ghiaccio OFF ON Deposito pieno OFF Lamp 10s Standby OFF Lamp 30s Fase ciclo Ozono OFF ON 1" Fase ciclo Lavaggio ON 1" ON 3" Fase carica gas (service) ON 1" ON 1"', 'metadata': {'emphasized_text_contents': ['ON 1"', 'ON 3"', 'Fase carica gas (service)', 'ON 1"', 'ON 1"'], 'emphasized_text_tags': ['i', 'i', 'i', 'i', 'i'], 'last_modified': '2024-03-04T08:54:58', 'text_as_html': '<table>\n<thead>\n<tr><th>Segnalazione / Allarme                             </th><th>ROSSO          </th><th>BIANCO        </th></tr>\n</thead>\n<tbody>\n<tr><td>(AL01) Allarme ciclo freddo troppo lungo           </td><td>1 x 0,5&quot;  </td><td>1 x 3,0&quot; </td></tr>\n<tr><td>(AL02) Allarme differenza durata cicli freddi      </td><td>2 x 0,5&quot;  </td><td>1 x 3,0&quot; </td></tr>\n<tr><td>(AL03) Allarme mancanza acqua (se presente sensore)</td><td>1 x 3,0&quot;  </td><td>1 x 0,5&quot; </td></tr>\n<tr><td>(AL04) Allarme sonda deposito ghiaccio difettosa   </td><td>3 x 0,5&quot;  </td><td>1 x 3,0&quot; </td></tr>\n<tr><td>(AL05) Richiesta manutenzione periodica            </td><td>ON 3&quot;     </td><td>ON 3&quot;    </td></tr>\n<tr><td>(AL06) Alta temperatura uscita condensatore        </td><td>ON             </td><td>OFF           </td></tr>\n<tr><td>(AL07) Allarme Sonda condensatore                  </td><td>4 x 0,5&quot;  </td><td>1 x 3,0&quot; </td></tr>\n<tr><td>(AL08) Sonda evaporatore (se presente)             </td><td>5 x 0,5&quot;  </td><td>1 x 3,0&quot; </td></tr>\n<tr><td>(AL09) Blackout - Mancanza alimentazione elettrica </td><td>OFF x 1,0&quot;</td><td>1 x 5,0&quot; </td></tr>\n<tr><td>(AL10) Allarme alta Pressione                      </td><td>ON             </td><td>OFF           </td></tr>\n<tr><td>(AL11) Allarme Pompa scarico                       </td><td>1 x 0,5&quot;  </td><td>1 x 0,5&quot; </td></tr>\n<tr><td>(AL12) Allarme sbrinamento lungo                   </td><td>6 x 0,5&quot;  </td><td>1 x 3,0 &quot;</td></tr>\n<tr><td>(AL14) Pulizia condensatore                        </td><td>7 x 0,5&quot;  </td><td>1 x 3,0&quot; </td></tr>\n<tr><td>(AL15) Inversione sonde                            </td><td>5 x 0,5&quot;  </td><td>2 x 0,5&quot; </td></tr>\n<tr><td>(AL17) Alta T� Evaporatore                         </td><td>1 x 3,0&quot;  </td><td>2 x 0,5&quot; </td></tr>\n<tr><td>Scaricamento dati HACCP e aggiornamento SW         </td><td>3 Lamp         </td><td>3 Lamp        </td></tr>\n<tr><td>Fase avvio macchina                                </td><td>OFF            </td><td>Lamp 2Hz      </td></tr>\n<tr><td>Fase produzione ghiaccio                           </td><td>OFF            </td><td>ON            </td></tr>\n<tr><td>Deposito pieno                                     </td><td>OFF            </td><td>Lamp 10s      </td></tr>\n<tr><td>Standby                                            </td><td>OFF            </td><td>Lamp 30s      </td></tr>\n<tr><td>Fase ciclo Ozono                                   </td><td>OFF            </td><td>ON 1&quot;    </td></tr>\n<tr><td>Fase ciclo Lavaggio                                </td><td>ON 1&quot;     </td><td>ON 3&quot;    </td></tr>\n<tr><td>Fase carica gas (service)                          </td><td>ON 1&quot;     </td><td>ON 1&quot;    </td></tr>\n</tbody>\n</table>', 'languages': ['ita'], 'parent_id': 'c9589367264ee5bb3a24aa48b6563cd8', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
