{'type': 'NarrativeText', 'element_id': '9404384a39db4cf12ab56a6119e2d8c9', 'text': "UN SOLO DISPOSITIVO (SMARTPHONE, TABLET , ETC.) , PUO' ESSERE CONNESSO AD UNA APPARECCHIATURA DOTATA DI GATEWAY, I SUCCESSIVI DISPOSITIVI", 'metadata': {'category_depth': 0, 'emphasized_text_contents': ["UN SOLO DISPOSITIVO (SMARTPHONE, TABLET , ETC.) , PUO' ESSERE CONNESSO AD UNA APPARECCHIATURA DOTATA DI GATEWAY, I SUCCESSIVI DISPOSITIVI"], 'emphasized_text_tags': ['b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': 'e742bbd6bea5dbb40bc0679db4e1ab0a', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'UncategorizedText', 'element_id': 'b675a395fde280e19723c419711b1279', 'text': 'CHE SI CONNETTERANNO VISUALIZZERANNO UNA APPARECCHIATURA NON COLLEGATA.', 'metadata': {'category_depth': 0, 'emphasized_text_contents': ['CHE SI CONNETTERANNO VISUALIZZERANNO UNA APPARECCHIATURA NON COLLEGATA.'], 'emphasized_text_tags': ['b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': 'e742bbd6bea5dbb40bc0679db4e1ab0a', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'UncategorizedText', 'element_id': 'f5f51b1388ab733dd118459a70d33c5a', 'text': "PER ACCEDERE CON UN ALTRO DISPOSITIVO CI SI DEVE DISCONNETTERE CON QUELLO COLLEGATO , E' SUFFICIENTE CHIUDERE LA APP.", 'metadata': {'category_depth': 0, 'emphasized_text_contents': ["PER ACCEDERE CON UN ALTRO DISPOSITIVO CI SI DEVE DISCONNETTERE CON QUELLO COLLEGATO , E' SUFFICIENTE CHIUDERE LA APP."], 'emphasized_text_tags': ['b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': 'e742bbd6bea5dbb40bc0679db4e1ab0a', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'ListItem', 'element_id': 'b4f6f73e2d199b7b649577c3b232da26', 'text': 'MONITORAGGIO MACCHINA CON APP', 'metadata': {'category_depth': 0, 'emphasized_text_contents': ['MONITORAGGIO MACCHINA CON APP'], 'emphasized_text_tags': ['b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': 'e742bbd6bea5dbb40bc0679db4e1ab0a', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'NarrativeText', 'element_id': '16db05bb49d548eff76955a6723cafb7', 'text': "E' stata realizzata una APP denominata AGS (All Gas System) , per permettere al cliente di accedere alle regolazioni quotidiane previste per il produttore di ghiaccio (Livello deposito ghiaccio, programmazione della produzione, ciclo di lavaggio etc.) , e anche per agevolare il Service, in fase di manutenzione , a visualizzare il funzionamento della macchina (allarmi, livello di produzione del ghiaccio, prestazioni, sinottico etc.), ed eventualmente intervenire sui parametri di regolazione.", 'metadata': {'category_depth': 0, 'emphasized_text_contents': ["E' stata realizzata una APP denominata AGS (All Gas System) , per permettere al cliente di accedere alle regolazioni quotidiane previste per il produttore di ghiaccio (Livello deposito ghiaccio, programmazione della produzione, ciclo di lavaggio etc.) , e anche per agevolare il Service, in fase di manutenzione , a visualizzare il funzionamento della macchina (allarmi, livello di produzione del ghiaccio, prestazioni, sinottico etc.), ed eventualmente intervenire sui parametri di regolazione."], 'emphasized_text_tags': ['b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': 'e742bbd6bea5dbb40bc0679db4e1ab0a', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'UncategorizedText', 'element_id': 'e5fa06e88e3188ce1cc836840e46a90d', 'text': 'Questa APP potrà essere installata su cellulari IOS e Android e si potrà scaricare dagli store relativi.', 'metadata': {'category_depth': 0, 'emphasized_text_contents': ['Questa APP potrà essere installata su cellulari IOS e Android e si potrà scaricare dagli store relativi.'], 'emphasized_text_tags': ['b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': 'e742bbd6bea5dbb40bc0679db4e1ab0a', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
