{'type': 'UncategorizedText', 'element_id': '039f9372b8487ca39bb7967906191cbb', 'text': 'Per interagire tramite la APP con un produttore di ghiaccio , vi sono delle condizioni da rispettare prima di procedere', 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': 'e742bbd6bea5dbb40bc0679db4e1ab0a', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'Title', 'element_id': '529541cb9f7577becf437613e0cd8c72', 'text': 'alla registrazione sulla APP del produttore di ghiaccio:', 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'ListItem', 'element_id': 'eb958279c0e7df8c1e446974a74ae82c', 'text': 'Assicurarsi sia attivato il blueTooth/GPS sul cellulare.', 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '529541cb9f7577becf437613e0cd8c72', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'ListItem', 'element_id': '635895e813a558d516ae71952a2f2215', 'text': 'Il produttore di ghiaccio sia dotato di Gateway (fig. 1.a) di comunicazione BlueTooth (posto normalmente vicino al', 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '529541cb9f7577becf437613e0cd8c72', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'Title', 'element_id': '4b8608b239eb1a9d0c40127d04a0ef25', 'text': 'quadro elettrico del produttore di ghiaccio).', 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'ListItem', 'element_id': 'b5c17283b1d77fa0d33f2e018dd2ed7d', 'text': 'Si sia in possesso del MAC Adress del gateway (presente sul manuale (fig. 1.b) o sul gateway (fig. 1.a) interessato).', 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '4b8608b239eb1a9d0c40127d04a0ef25', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
