{'type': 'NarrativeText', 'element_id': '6dc8c06182fd2a6ee52c7da5616753b7', 'text': 'Se la macchina e in standby, per avviare la produzione del ghiaccio , tenere premuto per 3 secondi il tasto (08)', 'metadata': {'category_depth': 0, 'emphasized_text_contents': ['(08)'], 'emphasized_text_tags': ['b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': 'd4c50f9c30095b6317b567ed805afc85', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'NarrativeText', 'element_id': '58b6c3bfc0eabbde1c797ae1a779aaa8', 'text': 'Una volta avviata la produzione del ghiaccio, i tasti delle funzioni accessorie (09) verranno disabilitati, non potendo essere eseguiti durante un ciclo di produzione del ghiaccio.', 'metadata': {'category_depth': 0, 'emphasized_text_contents': ['(09)'], 'emphasized_text_tags': ['b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': 'd4c50f9c30095b6317b567ed805afc85', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'NarrativeText', 'element_id': '869e7f5ec800a5606733da94e0e5f78c', 'text': 'Per poterli eseguire si deve fermare la macchina. Per', 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': 'd4c50f9c30095b6317b567ed805afc85', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'Title', 'element_id': '038518e8f8bcb5ff1ab5c961b493fcc5', 'text': 'arrestare la macchina è sufficiente premere il tasto (10).', 'metadata': {'category_depth': 0, 'emphasized_text_contents': ['(10)'], 'emphasized_text_tags': ['b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
