{'type': 'Title', 'element_id': '09c9ddfa6070f7ff5fdfce7496db8472', 'text': 'Con la variazione stagionale della temperatura ambiente', 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'NarrativeText', 'element_id': '0350387ced4aa44eafef8c44c1c0f570', 'text': ', può risultare necessario modificare il set della sonda deposito, che determina il livello massimo di ghiaccio in esso contenuto.', 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '09c9ddfa6070f7ff5fdfce7496db8472', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'NarrativeText', 'element_id': '128dbbb5d1d9f15557416542a5c8862f', 'text': 'Per fare questo si puo accedere alla modifica del set premendo il tasto (16).', 'metadata': {'category_depth': 0, 'emphasized_text_contents': ['(16)'], 'emphasized_text_tags': ['b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '09c9ddfa6070f7ff5fdfce7496db8472', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'NarrativeText', 'element_id': 'c94411022adae65f42906600f6ebaaeb', 'text': 'Per aumentare il livello di ghiaccio nel deposito, agire sul tasto (18), per diminuirlo invece agire sul tasto (17). Una volta terminata la regolazione , per confermare premere il tasto (20), per uscire senza modifiche invece il tasto (19).', 'metadata': {'category_depth': 0, 'emphasized_text_contents': ['(18)', '(17)', '(20)', '(19)'], 'emphasized_text_tags': ['b', 'b', 'b', 'b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '09c9ddfa6070f7ff5fdfce7496db8472', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'NarrativeText', 'element_id': '9660294568852ab67f2c8041fa242542', 'text': "ATTENZIONE! la rappresentazione grafica e puramente indicativa, va sempre controllato l'effettivo livello di ghiaccio a regime.", 'metadata': {'category_depth': 0, 'emphasized_text_contents': ["ATTENZIONE! la rappresentazione grafica e puramente indicativa, va sempre controllato l'effettivo livello di ghiaccio a regime.", "ATTENZIONE! la rappresentazione grafica e puramente indicativa, va sempre controllato l'effettivo livello di ghiaccio a regime."], 'emphasized_text_tags': ['b', 'i'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '09c9ddfa6070f7ff5fdfce7496db8472', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'ListItem', 'element_id': 'd5d4e365342cf1a535c1266ea458425d', 'text': 'Sincronizzazione orologio', 'metadata': {'category_depth': 1, 'emphasized_text_contents': ['Sincronizzazione orologio'], 'emphasized_text_tags': ['b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '09c9ddfa6070f7ff5fdfce7496db8472', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'UncategorizedText', 'element_id': '552d1a30e75b9ee673fe3346974e1690', 'text': "Al primo collegamento alla macchina è sempre consigliato aggiornare l'orologio interno della scheda con l'orario in vi- gore ,specie in presenza di fusi orari diversi o di passaggi da ora legale/solare.", 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '09c9ddfa6070f7ff5fdfce7496db8472', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'NarrativeText', 'element_id': '1d772ad29cf77f74606c3e076f405e90', 'text': "Per questo basta premere il tasto (21) e lanciare la sincro- nizzazione premendo il tasto (A) , che allineerà l'orologio della scheda a quello dello smartphone.", 'metadata': {'category_depth': 0, 'emphasized_text_contents': ['(21)', '(A)'], 'emphasized_text_tags': ['b', 'b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '09c9ddfa6070f7ff5fdfce7496db8472', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'NarrativeText', 'element_id': 'f5f4aec2ca2dc9ce898d47c1321f0f09', 'text': 'Dopo tale pressione verrò visualizzata la seguente fine- stra di regolazione del set.', 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '09c9ddfa6070f7ff5fdfce7496db8472', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'ListItem', 'element_id': 'ac695705788cafea8dd82ae2f1ce5a16', 'text': 'Avvio produzione ghiaccio a kg', 'metadata': {'category_depth': 1, 'emphasized_text_contents': ['Avvio produzione ghiaccio a kg'], 'emphasized_text_tags': ['b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '09c9ddfa6070f7ff5fdfce7496db8472', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'NarrativeText', 'element_id': '93e2db151873212b8a42fa0295c096a8', 'text': 'Nel caso si voglia produrre una quantità deﬁnita di kg di ghiaccio (naturalmente se superiore alla capacità del deposito , la macchina si arresterà comunque prima ,per deposito pieno) , si deve prima mettere in stand-by la macchina , se non lo è già, premendo il tasto (22).', 'metadata': {'category_depth': 0, 'emphasized_text_contents': ['una quantità deﬁnita di kg di ghiaccio', '(22).'], 'emphasized_text_tags': ['b', 'b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '09c9ddfa6070f7ff5fdfce7496db8472', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'NarrativeText', 'element_id': 'b7d37d5a8ad0cc1871ff2b665ca45a6f', 'text': 'Per aumentare i kg di ghiaccio da produrre agire sul tasto (25), per diminuirli invece agire sul tasto (24). Una volta terminata la regolazione, per confermare e avviare la produzione premere il tasto (27), per uscire senza avviare la produzione premere invece il tasto (26).', 'metadata': {'category_depth': 0, 'emphasized_text_contents': ['(25)', '(24)', '(27)', '(26)'], 'emphasized_text_tags': ['b', 'b', 'b', 'b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '09c9ddfa6070f7ff5fdfce7496db8472', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'UncategorizedText', 'element_id': 'e591ba9ecdf88d4df87b2da942266b10', 'text': 'Una volta messa in standby, si può avviare un ciclo di produzione del ghiaccio di peso definito premendo il tasto (23).', 'metadata': {'category_depth': 0, 'emphasized_text_contents': ['(23).'], 'emphasized_text_tags': ['b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '09c9ddfa6070f7ff5fdfce7496db8472', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'NarrativeText', 'element_id': 'b62cdbab211e4843ebcfdb8ebe410397', 'text': 'Comparirà la seguente finestra che permetterà di imposta- re la produzione di ghiaccio voluta.', 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '09c9ddfa6070f7ff5fdfce7496db8472', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'NarrativeText', 'element_id': '956109bdf8b99c77d8f77c597824cea7', 'text': "Se la produzione verrà avviata comparirà la seguente videata che monitorerà l'andamento della produzione del ghiaccio nel tempo. Per arrestare anticipatamente la produzione premere (27), mentre per ridurre la finestra premere (25). La finestra può essere riattivata a ciclo in corso, premendo il tasto (23).", 'metadata': {'category_depth': 0, 'emphasized_text_contents': ['(27)', '(25)', '(23)'], 'emphasized_text_tags': ['b', 'b', 'b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '09c9ddfa6070f7ff5fdfce7496db8472', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'UncategorizedText', 'element_id': '3f735c67d29014733cf56508d3c5dba2', 'text': '2527', 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '09c9ddfa6070f7ff5fdfce7496db8472', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'NarrativeText', 'element_id': '3d055313ccfb1feffa4579d055d2a0dd', 'text': 'ATTENZIONE! Se i kg impostati superano la capacità del deposito, la macchina si arresta per intervento della sonda deposito, e non si raggiungerà la produzione programmata.', 'metadata': {'category_depth': 0, 'emphasized_text_contents': ['ATTENZIONE! Se i kg impostati superano la capacità del deposito, la macchina si arresta per intervento della sonda deposito, e non si raggiungerà la produzione programmata.', 'ATTENZIONE! Se i kg impostati superano la capacità del deposito, la macchina si arresta per intervento della sonda deposito, e non si raggiungerà la produzione programmata.'], 'emphasized_text_tags': ['b', 'i'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '09c9ddfa6070f7ff5fdfce7496db8472', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'ListItem', 'element_id': 'f8ef0ff36141008ef113e06f2d78dffc', 'text': 'Avvio produzione ghiaccio a Programma', 'metadata': {'category_depth': 1, 'emphasized_text_contents': ['Avvio produzione ghiaccio a Programma'], 'emphasized_text_tags': ['b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '09c9ddfa6070f7ff5fdfce7496db8472', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'NarrativeText', 'element_id': '4a631e1c67654c27462976db431476bf', 'text': "Se si vuole del ghiaccio fresco e integro, a ridosso dell'ora in cui si vuole utilizzare, non basta definire quanto ghiaccio si vuole, ma anche a che ora. In questo modo sarà possibile, far produrre ghiaccio alla macchina, a ridosso dell'ora impo stata e non molte ore prima, evitando così il degrado e la contaminazione del ghiaccio nel deposito.", 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '09c9ddfa6070f7ff5fdfce7496db8472', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'NarrativeText', 'element_id': 'eca1afd9d722189f582cbab6fdd7edcf', 'text': 'Con la APP si potranno impostare le seguenti informazioni:', 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '09c9ddfa6070f7ff5fdfce7496db8472', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'ListItem', 'element_id': '7421397d87238574bb8f9b1586b998db', 'text': 'Quantità espressa in kg di ghiaccio da produrre', 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '09c9ddfa6070f7ff5fdfce7496db8472', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'ListItem', 'element_id': '39dff62f9decfea5baf2ffa7251fce4e', 'text': 'Arco temporale di produzione: [24H] - [48H] - [72H]', 'metadata': {'category_depth': 0, 'emphasized_text_contents': ['[24H] - [48H] - [72H]'], 'emphasized_text_tags': ['b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '09c9ddfa6070f7ff5fdfce7496db8472', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'ListItem', 'element_id': '851cd1a1da445df096fae6621011d5d7', 'text': 'Ora di fine produzione', 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '09c9ddfa6070f7ff5fdfce7496db8472', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'NarrativeText', 'element_id': '5eac8ab11d4e907a16b6588b8712fb00', 'text': 'L’arco temporale definisce se l’ora di fine produzione impostata al punto 3), è quella immediatamente successiva [24H] , o quella che si ripresenta per la seconda volta [48H] ,o invece per la terza volta [72H]. Riportiamo di seguito degli esempi per capire il funzionamento.', 'metadata': {'category_depth': 0, 'emphasized_text_contents': ['L’arco temporale', '[24H]', '[48H]', '[72H]'], 'emphasized_text_tags': ['b', 'b', 'b', 'b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '09c9ddfa6070f7ff5fdfce7496db8472', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'NarrativeText', 'element_id': 'ac82618f70c2625e11fac8d49ab4d9e7', 'text': '1° Esempio: ciclo di 24H con ora di fine produzione alle 10:00', 'metadata': {'category_depth': 0, 'emphasized_text_contents': ['1° Esempio: ciclo di 24H con ora di fine produzione alle 10:00', '1° Esempio: ciclo di 24H con ora di fine produzione alle 10:00'], 'emphasized_text_tags': ['b', 'i'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '09c9ddfa6070f7ff5fdfce7496db8472', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'NarrativeText', 'element_id': '811e9eefe6ed14c17e9205cc24e88a21', 'text': '2° Esempio: ciclo di 72H con ora di fine produzione alle 10:00.', 'metadata': {'category_depth': 0, 'emphasized_text_contents': ['2° Esempio: ciclo di 72H con ora di fine produzione alle 10:00.', '2° Esempio: ciclo di 72H con ora di fine produzione alle 10:00.'], 'emphasized_text_tags': ['b', 'i'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '09c9ddfa6070f7ff5fdfce7496db8472', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'NarrativeText', 'element_id': 'c68e91424bc2f0f36548d88529b1ab5d', 'text': 'Nel caso si voglia produrre una quantità deﬁnita di kg di ghiaccio (naturalmente se superiore alla capacità del deposito la macchina si arresterà comunque prima per deposito pieno), per una certa ora nei prossimi 3 giorni , si deve prima mettere in stand-by la macchina , se non lo è già, premendo il tasto (22).', 'metadata': {'category_depth': 0, 'emphasized_text_contents': ['una quantità deﬁnita di kg di ghiaccio', '(22).'], 'emphasized_text_tags': ['b', 'b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '09c9ddfa6070f7ff5fdfce7496db8472', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'NarrativeText', 'element_id': '105c0e6d6976dd0bbb7c544fea750c55', 'text': "Una volta messa in standby, si potrà impostare il ciclo di produzione programmata del ghiaccio, che permetterà di avere la quantità desiderata di ghiaccio, poco prima dell'ora impostata, e quindi con le massime caratteristiche di freschezza. Per iniziare la impostazione premere il tasto (28).", 'metadata': {'category_depth': 0, 'emphasized_text_contents': ['(28).'], 'emphasized_text_tags': ['b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '09c9ddfa6070f7ff5fdfce7496db8472', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'NarrativeText', 'element_id': '4d9cd90416ff67d0829fd5345d32fafe', 'text': 'Comparirà la seguente finestra che permetterà di imposta- re la produzione di ghiaccio programmata voluta.', 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '09c9ddfa6070f7ff5fdfce7496db8472', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'NarrativeText', 'element_id': '3e8e4854ecc99ab50b76fd708d994a09', 'text': "Impostare inizialmente il valore di ghiaccio da produrre desiderato, agendo sui tasti di incremento/decremento (29)/ (31).Impostare poi l'orario agendo sui tasti di incremento/ decremento (30)/(32), o modificare direttamente i valori di HH e MM premendo sopra il testo relativo.", 'metadata': {'category_depth': 0, 'emphasized_text_contents': ['(29)/ (31)', '(30)/(32)'], 'emphasized_text_tags': ['b', 'b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '09c9ddfa6070f7ff5fdfce7496db8472', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'UncategorizedText', 'element_id': '4db7fd169ddca75e1d42595aaaadffe5', 'text': "Impostare infine il periodo temporale in cui ricade l'orario di fine produzione scegliendo tra le 3 opzioni 24H-48H-72H (31).Infine per avviare il ciclo programmato premere (32) , mentre per uscire il tasto (33).", 'metadata': {'category_depth': 0, 'emphasized_text_contents': ['(31)', '(32)', '(33)'], 'emphasized_text_tags': ['b', 'b', 'b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '09c9ddfa6070f7ff5fdfce7496db8472', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'Title', 'element_id': 'ef1a418e372c42ba196ecb5fb1a5a6be', 'text': 'Nel caso si avvii il ciclo comparirà la seguente videata.', 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'NarrativeText', 'element_id': '3bcec9399e60c4eddf3693165a93511d', 'text': 'Ci sarà una prima parte in cui la macchina rimane ferma in attesa di partire (34) (segmenti arancioni) e una seconda di effettiva produzione del ghiaccio [35] (segmenti grigi). Per fermare anticipatamente il ciclo premere [36].', 'metadata': {'category_depth': 0, 'emphasized_text_contents': ['(34)', '[35]', '[36].'], 'emphasized_text_tags': ['b', 'b', 'b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': 'ef1a418e372c42ba196ecb5fb1a5a6be', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'UncategorizedText', 'element_id': 'a28e9a94a5754f484385cc126a415b01', 'text': 'Qualora il tempo disponibile, non permetta di produrre la quantità di ghiaccio impostata comparirà questo messaggio di errore:', 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': 'ef1a418e372c42ba196ecb5fb1a5a6be', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'Title', 'element_id': '4b5f0659814f8ac483b9cbc75a1ef2f3', 'text': 'In questo caso vi saranno due possibilità:', 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'ListItem', 'element_id': '3b991ff10a5b664de2cc7a98122838f2', 'text': "Premere tasto (A) e ritornare a reimpostare i valori (ora- rio e kg) per permettere l'avvio del ciclo.", 'metadata': {'category_depth': 1, 'emphasized_text_contents': ['(A)'], 'emphasized_text_tags': ['b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '4b5f0659814f8ac483b9cbc75a1ef2f3', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'ListItem', 'element_id': '8a64322ad627e3b22e0444f154a498ba', 'text': "Se il tempo disponibile permette di eseguire almeno un kg , allora premendo il tasto (B) verrà avviato un programma di produzione del ghiaccio che rispetterà l'ora impostata, ma produrrà una quantità di ghiaccio inferiore . Questa quantità verrà indicata nella finestra di esecuzione del ciclo programmato (C).", 'metadata': {'category_depth': 1, 'emphasized_text_contents': ['almeno un', 'kg', '(B)', '(C)'], 'emphasized_text_tags': ['b', 'b', 'b', 'b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '4b5f0659814f8ac483b9cbc75a1ef2f3', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'ListItem', 'element_id': '98127f1e458de1afeec7057c804e8c6c', 'text': 'Ciclo di Lavaggio - Saniﬁcazione', 'metadata': {'category_depth': 1, 'emphasized_text_contents': ['Ciclo di Lavaggio - Saniﬁcazione'], 'emphasized_text_tags': ['b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '4b5f0659814f8ac483b9cbc75a1ef2f3', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'UncategorizedText', 'element_id': 'bb7208bc9b5d7c04f1236a82a0093a5e', 'text': '!', 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '4b5f0659814f8ac483b9cbc75a1ef2f3', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'NarrativeText', 'element_id': 'bfb8dac7b025859ac1845900c217e48a', 'text': "Comparirà ora l'avviso di inserire il liquido sanificante-de- calcificante, nella bacinella evaporatore, una volta inserito premere il tasto (39) per avviare il ciclo o il tasto (40) per", 'metadata': {'category_depth': 0, 'emphasized_text_contents': ['(39)', '(40)'], 'emphasized_text_tags': ['b', 'b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '4b5f0659814f8ac483b9cbc75a1ef2f3', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'UncategorizedText', 'element_id': 'a6485915a646a60e354176505f5daae6', 'text': 'Interrompere.', 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '4b5f0659814f8ac483b9cbc75a1ef2f3', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'NarrativeText', 'element_id': 'd651c946e3c80c50058b004c2446a1dd', 'text': "Per la sanificazione della macchina è previsto un ciclo di lavaggio con soluzione di acido citrico o prodotto equiva- lente. Prima di avviare tale ciclo la macchina va pulita e va rimosso tutto il ghiaccio all'interno del deposito. Per av- viare il ciclo premere il tasto (37) partendo dallo stato di standby.", 'metadata': {'category_depth': 0, 'emphasized_text_contents': ['(37) partendo dallo stato di standby'], 'emphasized_text_tags': ['b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '4b5f0659814f8ac483b9cbc75a1ef2f3', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'NarrativeText', 'element_id': '29bed9070b4e604d39c238a14c58ef29', 'text': 'Comparirà la seguente videata che permetterà di monito- rare il lavaggio.', 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '4b5f0659814f8ac483b9cbc75a1ef2f3', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'NarrativeText', 'element_id': 'f7bfa55f431acdad967e7ac59dd03bd2', 'text': "Comparirà l'avviso di rimuovere il ghiaccio dalla macchina,", 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '4b5f0659814f8ac483b9cbc75a1ef2f3', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'Title', 'element_id': '350b618f080b00a8d768dbd32ce339ee', 'text': 'se già fatto premere il tasto (38).', 'metadata': {'category_depth': 0, 'emphasized_text_contents': ['(38)'], 'emphasized_text_tags': ['b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'NarrativeText', 'element_id': 'bb666fc0262d26d5c96b36bce32810dd', 'text': 'Nella prima fase di sanificazione NON si potrà interrompere anticipatamente il ciclo', 'metadata': {'category_depth': 0, 'emphasized_text_contents': ['NON si potrà interrompere anticipatamente il ciclo'], 'emphasized_text_tags': ['b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '350b618f080b00a8d768dbd32ce339ee', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'Title', 'element_id': 'c074325056dcd2ddb9b7ebd9746d391a', 'text': ', bisognerà che sia stato eseguito almeno il', 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'Title', 'element_id': 'f2ec6d74dda00dc9d1d4a37d2235689e', 'text': 'primo risciacquo.', 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
