{'type': 'Title', 'element_id': '3ad6bb1a82593acd9c71fff9a9d7abb4', 'text': 'Ozono (Opzionale)', 'metadata': {'category_depth': 0, 'emphasized_text_contents': ['Ozono (Opzionale)'], 'emphasized_text_tags': ['b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'UncategorizedText', 'element_id': 'e2febd5764dd5f9e2f19d0db028b18c6', 'text': 'Per maggiori informazioni consultare anche il paragrafo "Attivazione Ozono" del manuale d\'uso utente.', 'metadata': {'category_depth': 0, 'emphasized_text_contents': ['Per maggiori informazioni consultare anche il paragrafo "Attivazione Ozono" del manuale d\'uso utente.'], 'emphasized_text_tags': ['b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '3ad6bb1a82593acd9c71fff9a9d7abb4', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'UncategorizedText', 'element_id': 'b201703001347f7fbf01c33f5eacb315', 'text': "Comparirà il seguente messaggio, che ricorda che per rendere meno pericoloso e più efficace l'azione dell'ozono", 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '3ad6bb1a82593acd9c71fff9a9d7abb4', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'Title', 'element_id': 'b472d8a69d21d2ddbdf7a461c202c0a1', 'text': ', va chiuso lo sportello di chiusura del deposito. Una volta', 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'Title', 'element_id': 'baea8e3caa7a67dc69a6ca8f7019aab9', 'text': 'chiuso per avviare ciclo premere tasto (42).', 'metadata': {'category_depth': 0, 'emphasized_text_contents': ['(42)'], 'emphasized_text_tags': ['b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'UncategorizedText', 'element_id': '625f1b4f21ffb7afb8943eaf13766c28', 'text': "Nel caso sia presente il generatore di ozono , allora è pos- sibile avviare anche manualmente un ciclo di ozono che permette la generazione di ozono all'interno della macchi- na per un tempo definito in minuti dal parametro OZ2.", 'metadata': {'category_depth': 0, 'emphasized_text_contents': ['manualmente'], 'emphasized_text_tags': ['b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': 'baea8e3caa7a67dc69a6ca8f7019aab9', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
