{'type': 'NarrativeText', 'element_id': '3c2c6a8b3d37b9258dc12e6aa6656d40', 'text': "E' possibile forzare singolarmente le uscite , ma la macchina deve essere in standby. Per accedere alla lista delle uscite da forzare premere il tasto (55) del menù.", 'metadata': {'category_depth': 0, 'emphasized_text_contents': ['singolarmente', 'singolarmente', 'deve essere in standby', 'deve essere in standby', '(55)'], 'emphasized_text_tags': ['b', 'i', 'b', 'i', 'b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '68430e3a14afe3fc5b6db216dc13c858', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'NarrativeText', 'element_id': '70110090011b7aed2c9d1cc73f59f96a', 'text': 'Per forzare la singola uscita, premere sul tasto "Launch" relativo al carico interessato (56). Il carico si attiverà per un tempo limitato di alcuni secondi (il tasto diventerà arancione). Nel caso del carico CN11, va in precedenza impostato il valore agendo sui tasti +/- (57).', 'metadata': {'category_depth': 0, 'emphasized_text_contents': ['(56)', 'il tasto diventerà arancione'], 'emphasized_text_tags': ['b', 'b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '68430e3a14afe3fc5b6db216dc13c858', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'NarrativeText', 'element_id': '7b89df58a4aea5c45ef5512214be330e', 'text': 'Questi test serviranno a verificare la funzionalità e il cor- retto cablaggio di ogni singolo carico. Per uscire da questa videata premere il tasto (58).', 'metadata': {'category_depth': 0, 'emphasized_text_contents': ['(58)'], 'emphasized_text_tags': ['b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '68430e3a14afe3fc5b6db216dc13c858', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
