{'type': 'ListItem', 'element_id': '820b7132c5b6a374c962e2b01166d74c', 'text': 'Ricarica libreria parametri di default: dopo modifiche dei parametri fatte manualmente, nel caso si voglia recuperare la libreria dei parametri di default di una scheda, basta premere il tasto (B), e uscire successivamente premendo il tasto (E).', 'metadata': {'category_depth': 2, 'emphasized_text_contents': ['Ricarica libreria parametri di default', '(B),', '(E)'], 'emphasized_text_tags': ['b', 'b', 'b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '6dc6b01a6012978bb1b47c866bcea52f', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'ListItem', 'element_id': '68e76c195d01f140097dbc452290dbb0', 'text': 'Cambio libreria parametri: nel caso si voglia cambiare la libreria dei parametri di configurazione di una scheda (questo succede spesso nel caso di sostituzione di una scheda elettronica) , dopo avere impostato con i tasti (C1) il numero di libreria voluto, confermare il cambio premendo il tasto (C), e uscire successivamente premendo il tasto (E).', 'metadata': {'category_depth': 2, 'emphasized_text_contents': ['Cambio libreria parametri', '(C1)', '(C),', '(E)'], 'emphasized_text_tags': ['b', 'b', 'b', 'b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '6dc6b01a6012978bb1b47c866bcea52f', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'ListItem', 'element_id': '0b19ccee85ece256818fd59ffdadccd9', 'text': 'Sovrascrittura parametri libreria: se dopo la modifica di alcuni parametri, si vuole cambiare e memorizzare in una libreria parametri, la nuova configurazione impostata, dopo avere impostato con i tasti (D1) il numero di libre- ria voluto, confermare la sovrascrittura premendo il tasto (D), e uscire successivamente premendo il tasto (E).', 'metadata': {'category_depth': 2, 'emphasized_text_contents': ['Sovrascrittura parametri libreria', '(D1)', '(D),', '(E)'], 'emphasized_text_tags': ['b', 'b', 'b', 'b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '6dc6b01a6012978bb1b47c866bcea52f', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'NarrativeText', 'element_id': 'f62277827d6eeed164473f15247fd5bb', 'text': 'Durante lo sbrinamento apparirà il seguente grafico circo- lare, che informerà sullo stato di avanzamento dello sbrinamento. Se si vuole arrestare anticipatamente lo sbrina- mento premere il tasto (74), invece se si vuole ridurre la finestra premere la croce (73) , per ritornare alla videata sbrinamento ripremere il tasto (70).', 'metadata': {'category_depth': 0, 'emphasized_text_contents': ['(74),', '(73)', '(70).'], 'emphasized_text_tags': ['b', 'b', 'b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '6dc6b01a6012978bb1b47c866bcea52f', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
