{'type': 'NarrativeText', 'element_id': '9f9c4fd2789e20ee83b38abcbff2ab70', 'text': "E' possibile visualizzare lo stato della macchina su un sinottico dedicato. Per accedervi basta premere il tasto (79).", 'metadata': {'category_depth': 0, 'emphasized_text_contents': ['(79).'], 'emphasized_text_tags': ['b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '42cf03cb260e2cec7626823c23fd5166', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'ListItem', 'element_id': '67be96e0340fb69c35c9ffecba25e172', 'text': 'Dati service', 'metadata': {'category_depth': 1, 'emphasized_text_contents': ['Dati service'], 'emphasized_text_tags': ['b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '42cf03cb260e2cec7626823c23fd5166', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
