{'type': 'NarrativeText', 'element_id': 'd06794b415a0934e05b228f6e75bd227', 'text': 'del service (par.9.11), si deve premere il tasto (81).', 'metadata': {'category_depth': 0, 'emphasized_text_contents': ['(81)'], 'emphasized_text_tags': ['b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '42cf03cb260e2cec7626823c23fd5166', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'UncategorizedText', 'element_id': 'e82bdb1ad9bc66c27afd73c33cb1cdbe', 'text': '79\t81', 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '42cf03cb260e2cec7626823c23fd5166', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'NarrativeText', 'element_id': 'cd698320a0814b2a5d35a6f3bb89c324', 'text': 'Sul sinottico si potranno leggere i valori o gli stati degli ingressi e delle uscite e visualizzare i carichi collegati, per uscire premere il tasto (80).', 'metadata': {'category_depth': 0, 'emphasized_text_contents': ['(80)'], 'emphasized_text_tags': ['b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '42cf03cb260e2cec7626823c23fd5166', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'NarrativeText', 'element_id': 'a285f1be5a641645ccb1ce66ef64653e', 'text': 'Il service dovrà compilare i vari campi, cliccando sopra i campi o i valori esistenti, una volta terminato potrà salvare i dati premendo il tasto (83), oppure uscendo premendo il tasto (82).', 'metadata': {'category_depth': 0, 'emphasized_text_contents': ['(83)', '(82)'], 'emphasized_text_tags': ['b', 'b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '42cf03cb260e2cec7626823c23fd5166', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
