{'type': 'ListItem', 'element_id': 'fa48ed74e5112e88e2e72d482225a53a', 'text': 'Dati prestazionali', 'metadata': {'category_depth': 1, 'emphasized_text_contents': ['Dati prestazionali'], 'emphasized_text_tags': ['b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '42cf03cb260e2cec7626823c23fd5166', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'NarrativeText', 'element_id': 'eb16ebcb8bec01ba186fee38965fc2f1', 'text': 'La macchina conserva i dati prestazionali delle ultime 24H. Per visualizzarli basta premere il tasto (84).', 'metadata': {'category_depth': 0, 'emphasized_text_contents': ['(84)'], 'emphasized_text_tags': ['b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '42cf03cb260e2cec7626823c23fd5166', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'ListItem', 'element_id': '16cda2ef0a0854ffe94204ea260fc1d0', 'text': 'TEST PRIMA INSTALLAZIONE', 'metadata': {'category_depth': 0, 'emphasized_text_contents': ['TEST PRIMA INSTALLAZIONE'], 'emphasized_text_tags': ['b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '42cf03cb260e2cec7626823c23fd5166', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'NarrativeText', 'element_id': '91c51d5c438a0c31f5043a40d947b359', 'text': 'ATTENZIONE! Le operazioni di seguito riportate possono essere svolte UNICAMENTE da personale specializzato e formato, e devono essere rispettate tutte le avvertenze del capitolo 1.', 'metadata': {'category_depth': 0, 'emphasized_text_contents': ['ATTENZIONE! Le operazioni di seguito riportate possono essere svolte UNICAMENTE da personale specializzato e formato, e devono essere rispettate tutte le avvertenze del capitolo 1.', 'ATTENZIONE! Le operazioni di seguito riportate possono essere svolte UNICAMENTE da personale specializzato e formato, e devono essere rispettate tutte le avvertenze del capitolo 1.'], 'emphasized_text_tags': ['b', 'i'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '42cf03cb260e2cec7626823c23fd5166', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'NarrativeText', 'element_id': 'e461cdf3f4fb98356db8815412bff3fb', 'text': 'Alla prima installazione, o dopo una importante manutenzione, deve essere eseguito il test di collaudo di prima in- stallazione. Suggeriamo di partire con macchina in stand- by. Per accedere al test premere il tasto (86).', 'metadata': {'category_depth': 0, 'emphasized_text_contents': ['(86)'], 'emphasized_text_tags': ['b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '42cf03cb260e2cec7626823c23fd5166', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'NarrativeText', 'element_id': 'f2822c2685cf5cbda9200dbdc128aa45', 'text': 'Quando la macchina rileva che è stato eseguito un ciclo completo di produzione del ghiaccio, chiederà di pesare il ghiaccio prodotto e di inserirlo come informazione nella finestra di seguito rappresentata.', 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '42cf03cb260e2cec7626823c23fd5166', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'NarrativeText', 'element_id': 'ffaf5545da6c38ef23d80da02ee7d635', 'text': 'Una volta inserito il dato in grammi della pesata, e premuto il tasto (89), il software dirà se la macchina funziona correttamente o meno. Se il test è stato superato , va salvato sulla scheda elettronica premendo il tasto (90).', 'metadata': {'category_depth': 0, 'emphasized_text_contents': ['(90)'], 'emphasized_text_tags': ['b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '42cf03cb260e2cec7626823c23fd5166', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'NarrativeText', 'element_id': '15e9696ce4ad5544a0fd5a29ae4833d3', 'text': "Una volta apparsa la videata di Test, per avviarlo premere il tasto (87). Verrà visualizzata la seguente videata che rappresenterà l'andamento delle temperature delle sonde, premendo il tasto (88) si accederà alla finestra che visualizza il sinottico, dove potremo vedere anche altre grandezze e stati macchina.", 'metadata': {'category_depth': 0, 'emphasized_text_contents': ['(87)'], 'emphasized_text_tags': ['b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '42cf03cb260e2cec7626823c23fd5166', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'NarrativeText', 'element_id': 'ca5088e2be2b9e6f33a7e2b034825531', 'text': 'Nel caso il test non venga superato va verificata la mac- china o le sue regolazioni.', 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '42cf03cb260e2cec7626823c23fd5166', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
