{'type': 'Title', 'element_id': '7732a3ba2c7c6830d58bf51db4eb72b4', 'text': "Riportiamo di seguito le operazioni da fare per aggiornare il Software dell'apparecchiatura.", 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'ListItem', 'element_id': 'f398bae8b71d8d593e4a6ede1d63cba6', 'text': "Salvare il file di aggiornamento in una chiavetta USB, alla radice (non all'interno di una directory). Nel nome del file è riportato anche il livello di revisione del software, rappresentato dal testo in grassetto:", 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '7732a3ba2c7c6830d58bf51db4eb72b4', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
