{'type': 'ListItem', 'element_id': '40f39a63bc37b62bd05a8c099d2cb113', 'text': "Alimentare l'apparecchiatura, inizierà il caricamento del nuovo software. Durante il caricamento il led del tasto capacitivo avrà una sequenza di 3 lampeggi bianchi e 3 lampeggi rossi ripetuti fino al termine del caricamento che sarà segnalato da un segnale sonoro e dal termine del lampeggiamento continuo (passerà al lampeggio in stand-by). Togliere l'alimentazione elettrica, rimuovere la chiave USB dalla scheda e richiudere la macchina.", 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': 'a63750f84df4a23269ae31310fe14988', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
