{'type': 'ListItem', 'element_id': '38bd9915ab72afa7cf7d77aee0a67c07', 'text': 'SOSTITUZIONE\tSCHEDA ELETTRONICA', 'metadata': {'category_depth': 0, 'emphasized_text_contents': ['SOSTITUZIONE\tSCHEDA ELETTRONICA'], 'emphasized_text_tags': ['b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '2fb9438b6d4ad12d72a7eb81d7dd42f8', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'NarrativeText', 'element_id': '38e00edd592ce6dba34ae74895c46bec', 'text': 'Nel caso si debba sostituire la scheda, oltre a inserire il Software aggiornato , è necessario selezionare la lista parametri corretta per il modello di produttore del ghiaccio (vedi tabella parametro e sigle PAR-XX). Ci saranno due modalità a seconda di essere in possesso o meno del kit display.', 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '2fb9438b6d4ad12d72a7eb81d7dd42f8', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'NarrativeText', 'element_id': '72a6121c7cbbce2782abbd020332b3d4', 'text': "dopo l'eventuale aggiornamento del software, andranno inseriti in una chiavetta vuota i seguenti due file:", 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '2fb9438b6d4ad12d72a7eb81d7dd42f8', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'Title', 'element_id': 'dd27567910370f2747bdb2d7138a1433', 'text': 'PA_DataBank_xxx\t- > Biblioteca parametri , che contiene 15 liste parametri', 'metadata': {'category_depth': 0, 'emphasized_text_contents': ['PA_DataBank_'], 'emphasized_text_tags': ['b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'Title', 'element_id': 'c14c51fe70558bcb4310c06588fc6b8d', 'text': 'PA_Init_Load_xxx\t- > Informazione su quale lista di parametri caricare', 'metadata': {'category_depth': 0, 'emphasized_text_contents': ['PA_Init_Load_'], 'emphasized_text_tags': ['b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'NarrativeText', 'element_id': '69d10f0b26435813a8595e8c6a3a0175', 'text': 'Proprio questo ultimo file va modificato , con un Editor di testo , impostando il numero lista parametri scelto tra un massimo 15 . Riportiamo di seguito un esempio di file con banca parametri 7 (PAR-07) selezionata:', 'metadata': {'category_depth': 0, 'emphasized_text_contents': ['impostando il numero lista parametri scelto tra un massimo 15', 'impostando il numero lista parametri scelto tra un massimo 15'], 'emphasized_text_tags': ['b', 'i'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': 'c14c51fe70558bcb4310c06588fc6b8d', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'NarrativeText', 'element_id': '64ef0fe99dc59fb035323454cd06b0c5', 'text': 'Successivamente entrambi i file vanno salvati su una chiavetta vuota', 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': 'c14c51fe70558bcb4310c06588fc6b8d', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'NarrativeText', 'element_id': '6e693ceac05d1d96833ee7737816129f', 'text': "E con la stessa procedura dell'aggiornamento software , si esegue l'aggiornamento della lista parametri del produttore del ghiaccio. Si consiglia di mettere queste due file al primo livello della chiavetta di aggiornamento software per fare una unica operazione.", 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': 'c14c51fe70558bcb4310c06588fc6b8d', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'NarrativeText', 'element_id': 'c35217679c580a30364d32640d150c5c', 'text': 'Il produttore si riserva il diritto di apportare modifiche sia tecniche che estetiche senza preavviso. The manufacturer reserves the right to change models and specifications without prior notice.', 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': 'c14c51fe70558bcb4310c06588fc6b8d', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
