{'type': 'NarrativeText', 'element_id': '470aa9ba0d380c8379194a75afd88aa5', 'text': "Il Fabbricante si riserva il diritto di apportare modifiche in qualunque momento, senza darne preavviso e senza alcun impegno da parte sua E' vietata la riproduzione parziale o totale di questo manuale senza preventiva autorizzazione scritta da parte del costruttore", 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': 'dc97dc63b0cced9f128e764f467b24e3', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
