{'type': 'NarrativeText', 'element_id': 'afac6f70b4a930c153940c91ea1b76b6', 'text': 'Il simbolo del bidone sbarrato indica il non poter smaltire questo prodotto come rifiuto domestico', 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': 'dc97dc63b0cced9f128e764f467b24e3', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'NarrativeText', 'element_id': '50b726156ecfcd999782114355964c88', 'text': ' L’accertamento che questo prodotto sia smaltito correttamente contribuirà ad impedire le potenziali conseguenze negative per l’ambiente e la salute umana che potrebbero essere causati, al contrario, dall’errato smalti- mento dello stesso', 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': 'dc97dc63b0cced9f128e764f467b24e3', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
