{'type': 'ListItem', 'element_id': 'c56d0c68b79dc17a5922e7f56f723c00', 'text': 'la pressione dell’acqua di alimentazione non sia inferiore a 0,1 MPa (1 bar) e non su- peri i 0,5 MPa (5 bar). Qualora la pressione superi i 0,5 MPa prevedere l’applicazione di un riduttore di pressione sull’alimentazione idrica alla macchina.', 'metadata': {'category_depth': 0, 'emphasized_text_contents': ['la pressione dell’acqua di alimentazione non sia inferiore a 0,1 MPa (1 bar) e non su- peri i 0,5 MPa (5 bar). Qualora la pressione superi i 0,5 MPa prevedere l’applicazione di un riduttore di pressione sull’alimentazione idrica alla macchina.'], 'emphasized_text_tags': ['b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '254d9594d7ef5a99cfe8b4792ef6f256', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'ListItem', 'element_id': '342b598915831f8a7c007e678827c3e6', 'text': 'Prima di effettuare operazioni di pulizia o di manutenzione, scollegare la macchina dal- la rete di alimentazione elettrica azionando l’interruttore generale e staccando la spina. Se la presa è ad una distanza o posizione non controllabile dall’operatore oppure l’apparecchio è sprovvisto di spina, deve es- sere installato un dispositivo per la disconnessione elettrica lucchettabile onde evitare la connessione accidentale dell’apparecchio.', 'metadata': {'category_depth': 0, 'emphasized_text_contents': ['Prima di effettuare operazioni di pulizia o di manutenzione, scollegare la macchina dal- la rete di alimentazione elettrica azionando l’interruttore generale e staccando la spina. Se la presa è ad una distanza o posizione non controllabile dall’operatore oppure l’apparecchio è sprovvisto di spina, deve es- sere installato un dispositivo per la disconnessione elettrica lucchettabile onde evitare la connessione accidentale dell’apparecchio.'], 'emphasized_text_tags': ['b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '254d9594d7ef5a99cfe8b4792ef6f256', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'ListItem', 'element_id': '0167bbdd6f6a807adf735c121d3af88a', 'text': 'le operazioni di manutenzione ordinaria e straordinaria devono essere eseguite sola- mente da tecnici installatori abilitati.', 'metadata': {'category_depth': 0, 'emphasized_text_contents': ['le operazioni di manutenzione ordinaria e straordinaria devono essere eseguite sola- mente da tecnici installatori abilitati.'], 'emphasized_text_tags': ['b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '254d9594d7ef5a99cfe8b4792ef6f256', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'ListItem', 'element_id': 'e1d52f341aea33f074385138e147c452', 'text': 'Si declina ogni responsabilità per danni a persone, animali o cose derivanti dalla mancata messa a terra dell’apparecchio e dalla realizzazione di un impianto elettrico non conforme alle norme vigenti.', 'metadata': {'category_depth': 0, 'emphasized_text_contents': ['Si declina ogni responsabilità per danni a persone, animali o cose derivanti dalla mancata messa a terra dell’apparecchio e dalla realizzazione di un impianto elettrico non conforme alle norme vigenti.'], 'emphasized_text_tags': ['b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '254d9594d7ef5a99cfe8b4792ef6f256', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'ListItem', 'element_id': 'ef42764567f3c0d14ec270a83bd53ec8', 'text': 'Utilizzare il nuovo set di giunzioni mobili (tubo acqua) fornito con l’apparecchio. Il vecchio set di giunzioni non deve essere ri- utilizzato.', 'metadata': {'category_depth': 0, 'emphasized_text_contents': ['Utilizzare il nuovo set di giunzioni mobili (tubo acqua) fornito con l’apparecchio. Il vecchio set di giunzioni non deve essere ri- utilizzato.'], 'emphasized_text_tags': ['b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '254d9594d7ef5a99cfe8b4792ef6f256', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'ListItem', 'element_id': '111eb6ad462dd8435bafd47547b6d091', 'text': 'In caso di manutenzione che necessita di sostituzione di parti della macchina è obbligatorio l’utilizzo di parti di ricambio originali.', 'metadata': {'category_depth': 0, 'emphasized_text_contents': ['In caso di manutenzione che necessita di sostituzione di parti della macchina è obbligatorio l’utilizzo di parti di ricambio originali.'], 'emphasized_text_tags': ['b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '254d9594d7ef5a99cfe8b4792ef6f256', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'ListItem', 'element_id': 'a3cfaaff3e9d6f8175f9371fa7d0868e', 'text': 'Per informazioni rivolgersi al venditore o alla assistenza tecnica del fabbricante.', 'metadata': {'category_depth': 0, 'emphasized_text_contents': ['Per informazioni rivolgersi al venditore o alla assistenza tecnica del fabbricante.'], 'emphasized_text_tags': ['b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '254d9594d7ef5a99cfe8b4792ef6f256', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'ListItem', 'element_id': 'e5600f29090a7ecea6e14ba03f9e63e4', 'text': 'In caso di funzionamento anomalo dell’apparecchio o la comparsa di allarmi , sconnettere la macchina dall’alimentazione elettrica e idrica e consultare il Cap. 6 per la spiegazione e la risoluzione dei problemi.', 'metadata': {'category_depth': 0, 'emphasized_text_contents': ['In caso di funzionamento anomalo dell’apparecchio o la comparsa di allarmi , sconnettere la macchina dall’alimentazione elettrica e idrica e consultare il Cap. 6 per la spiegazione e la risoluzione dei problemi.'], 'emphasized_text_tags': ['b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '254d9594d7ef5a99cfe8b4792ef6f256', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'ListItem', 'element_id': 'f55eeb57df207875f5b5ce3d4714ef8e', 'text': 'Il livello di Pressione Sonora è inferiore a 70 dB(A).', 'metadata': {'category_depth': 0, 'emphasized_text_contents': ['Il livello di Pressione Sonora è inferiore a 70 dB(A).'], 'emphasized_text_tags': ['b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '254d9594d7ef5a99cfe8b4792ef6f256', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'ListItem', 'element_id': '71784089f034505a916f4f2a8a905ba5', 'text': "Per le apparecchiature condensate ad acqua , la temperatura massima dell'acqua in entrata non deve superare i 30°C (86°F)", 'metadata': {'category_depth': 0, 'emphasized_text_contents': ["Per le apparecchiature condensate ad acqua , la temperatura massima dell'acqua in entrata non deve superare i 30°C (86°F)"], 'emphasized_text_tags': ['b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '254d9594d7ef5a99cfe8b4792ef6f256', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'ListItem', 'element_id': '2b06aaf069fb4a20e3f2ff0a130afa3f', 'text': 'Veriﬁcare il corretto serraggio delle fascette, della bulloneria, della viteria e dei morsetti che potrebbero essersi allentati durante il trasporto, per evitare la fuoriuscita di acqua o altri problemi durante il funzionamento del- la macchina.', 'metadata': {'category_depth': 0, 'emphasized_text_contents': ['Veriﬁcare il corretto serraggio delle fascette, della bulloneria, della viteria e dei morsetti che potrebbero essersi allentati durante il trasporto, per evitare la fuoriuscita di acqua o altri problemi durante il funzionamento del- la macchina.'], 'emphasized_text_tags': ['b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '254d9594d7ef5a99cfe8b4792ef6f256', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'ListItem', 'element_id': 'a675ff21a33e2d97390b38e08d1c0551', 'text': 'Ogni 3 - 4 anni di funzionamento della macchina, veriﬁcare lo stato di serraggio ed efficienza dei contatti elettrici soprattutto nelle bobine dei teleruttori e all’interno dei relè. Sostituire subito il componente, con un ricambio originale, se appare usurato o os- sidato. Aumentare la frequenza di questo in- tervento se la macchina è sottoposta ad uso particolarmente intensivo o continuativo.', 'metadata': {'category_depth': 0, 'emphasized_text_contents': ['Ogni 3 - 4 anni di funzionamento della macchina, veriﬁcare lo stato di serraggio ed efficienza dei contatti elettrici soprattutto nelle bobine dei teleruttori e all’interno dei relè. Sostituire subito il componente, con un ricambio originale, se appare usurato o os- sidato. Aumentare la frequenza di questo in- tervento se la macchina è sottoposta ad uso particolarmente intensivo o continuativo.'], 'emphasized_text_tags': ['b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '254d9594d7ef5a99cfe8b4792ef6f256', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
