{'type': 'ListItem', 'element_id': '8feeaf53074c7f569297b26e4c9e461f', 'text': 'L’apparecchio contiene gas fluorurati ad effetto serra disciplinati dal protocollo di Kyoto, nelle quantità indicate nella targhetta matricola. Il tipo di gas refrigerante presente nel circuito frigorifero dell’apparecchio è ri- portato nella targhetta matricola (ﬁg. 10). Il GWP (Potenziale di riscaldamento globale) del gas HFC R134a è di 1430.', 'metadata': {'category_depth': 0, 'emphasized_text_contents': ['L’apparecchio contiene gas fluorurati ad effetto serra disciplinati dal protocollo di Kyoto, nelle quantità indicate nella targhetta matricola. Il tipo di gas refrigerante presente nel circuito frigorifero dell’apparecchio è ri- portato nella targhetta matricola (ﬁg. 10). Il GWP (Potenziale di riscaldamento globale) del gas HFC R134a è di 1430.'], 'emphasized_text_tags': ['b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': 'a47642139c1daf48eed30669a6a8a3c4', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
