{'type': 'Table', 'element_id': '30a781c62018c2d6c15b926aebe6bd37', 'text': 'Allarme Stato Macchina Soluzione (AL01) Allarme ciclo freddo troppo lungo Macchina si ferma in standby, un semplice tocco del tasto riavvia la macchina. Controllare pulizia e areazione condensatore, verificare se vi sono perdite di gas, verificare funzionamento motoriduttore palette, verificare micro inizio defrost. (AL02) Allarme differenza durata cicli freddi Macchina continua a lavorare, si azzera allarme con tocco tasto Se macchina è partita calda, verificare assenza allarmi dopo 3 cicli continui, verificare funzionamento motoriduttore palette, controllare pulizia e areazione condensatore, verificare temperatura acqua se stabile, verificare perdite gas. (AL03) Allarme mancanza acqua (se presente sensore) Macchina ferma o in attesa di tentativo di avvio successivo automatico Verificare alimentazione idrica, verifica assenza di perdite acqua nel circuito, verificare funzionamento valvola ingresso acqua e pulire filtrino acqua, verifi- care posizione sensore. (AL04) Allarme sonda deposito ghiaccio difettosa Macchine ferma Verificare connessione sonda alla scheda, verificare integrità sonda, verificare se valore in ohm letto è corretto, sostituire sonda - Verificando preventivamente che ci sia spazio nel deposito, si possono avviare due cicli di produzione di ghiaccio toccando il tasto (AL05) Richiesta manu- tenzione periodica Macchina continua a lavorare Chiamare assistenza per manutenzione periodica, (azzerare la segnalazione toccando per 10 secondi il tasto) (AL06) Alta temperatura uscita condensatore Macchina si ferma, ventilatore condensatore rimane acceso per abbassare la temperatura condensatore, o valvola acqua rimane aperta in caso di condensazione ad acqua. (una volta raffreddata la macchina riparte facendo alcuni tentativi per vedere se allarme è passa- to, dopodiché si blocca definitivamente) Controllare pulizia e areazione condensatore, verificare se ventilatore condensatore gira, verificare posizione sonda condensatore, nelle versioni condensate ad acqua verificare alimentazione idrica e funzionalità valvola ingresso acqua. (AL07) Allarme Sonda condensatore Sonda condensatore difettosa o al di fuori dell\'intervallo dei valori ammessi, la macchina funziona con ventilazione in continua o ingresso acqua attivato sempre. Verificare connessione sonda condensatore alla scheda, verificare se valore in ohm letto è corretto, sostituire sonda. (AL08) Sonda evapora- tore (se presente) Sonda evaporatore difettosa o fuori intervallo dei valori ammessi, se serve la macchina funziona con i dati storici Verificare connessione sonda evaporatore alla scheda, verificare se cubetti di ghiaccio sono accumulati nella zona evaporatore, verificare se valore in ohm letto è corretto, sostituire sonda. (AL09) Blackout - Mancanza alimentazione elettrica La macchina riprenderà a funzionare nello stato precedente all\'interruzione di corrente. "Verificare connessioni elettriche e fonte di alimentazione. (Per togliere segnalazione allarme, tocco singolo per tacitare buzzer secondo tocco per togliere la segnalazione se si è dentro il primo minuto, solo il secondo tocco se è già passato il minuto).', 'metadata': {'last_modified': '2024-03-04T08:54:58', 'text_as_html': '<table>\n<thead>\n<tr><th>Allarme                                            </th><th>Stato Macchina                                                                                                                                                                                                                                                                                                   </th><th>Soluzione                                                                                                                                                                                                                                                                  </th></tr>\n</thead>\n<tbody>\n<tr><td>(AL01) Allarme ciclo freddo troppo lungo           </td><td>Macchina si ferma in standby, un semplice tocco del tasto riavvia la macchina.                                                                                                                                                                                                                                   </td><td>Controllare pulizia e areazione condensatore, verificare se vi sono perdite di gas, verificare funzionamento motoriduttore palette, verificare micro inizio defrost.                                                                                                       </td></tr>\n<tr><td>(AL02) Allarme differenza durata cicli freddi      </td><td>Macchina continua a lavorare, si azzera\nallarme con tocco tasto                                                                                                                                                                                                                                                                                                                  </td><td>Se macchina è partita calda, verificare assenza allarmi dopo 3 cicli continui, verificare funzionamento motoriduttore palette, controllare\npulizia e areazione condensatore, verificare temperatura acqua se stabile, verificare perdite gas.                                                                                                                                                                                                                                                                            </td></tr>\n<tr><td>(AL03) Allarme mancanza acqua (se presente sensore)</td><td>Macchina ferma o in attesa di tentativo di avvio successivo automatico                                                                                                                                                                                                                                           </td><td>Verificare alimentazione idrica, verifica assenza di perdite acqua nel circuito, verificare funzionamento valvola ingresso acqua e pulire filtrino acqua, verifi- care posizione sensore.                                                                                  </td></tr>\n<tr><td>(AL04) Allarme sonda deposito ghiaccio difettosa   </td><td>Macchine ferma                                                                                                                                                                                                                                                                                                   </td><td>Verificare connessione sonda alla scheda, verificare integrità sonda, verificare se valore in ohm letto è corretto, sostituire sonda - Verificando preventivamente che ci sia spazio nel deposito, si possono avviare due cicli di produzione di ghiaccio toccando il tasto</td></tr>\n<tr><td>(AL05) Richiesta manu- tenzione periodica          </td><td>Macchina continua a lavorare                                                                                                                                                                                                                                                                                     </td><td>Chiamare assistenza per manutenzione periodica, (azzerare la segnalazione toccando per 10 secondi il tasto)                                                                                                                                                                </td></tr>\n<tr><td>(AL06) Alta temperatura uscita condensatore        </td><td>Macchina si ferma, ventilatore condensatore rimane acceso per abbassare la temperatura condensatore, o valvola acqua rimane aperta in caso di condensazione ad acqua. (una volta raffreddata la macchina riparte facendo alcuni tentativi per vedere se allarme è passa- to, dopodiché si blocca definitivamente)</td><td>Controllare pulizia e areazione condensatore, verificare se ventilatore condensatore gira, verificare posizione sonda condensatore, nelle versioni condensate ad acqua verificare alimentazione idrica e funzionalità valvola ingresso acqua.                              </td></tr>\n<tr><td>(AL07) Allarme Sonda condensatore                  </td><td>Sonda condensatore difettosa o al di fuori dell&#x27;intervallo dei valori ammessi, la macchina funziona con ventilazione in continua o ingresso acqua attivato sempre.                                                                                                                                          </td><td>Verificare connessione sonda condensatore alla scheda, verificare se valore in ohm letto è corretto, sostituire sonda.                                                                                                                                                     </td></tr>\n<tr><td>(AL08) Sonda evapora- tore (se presente)           </td><td>Sonda evaporatore difettosa o fuori intervallo dei valori ammessi, se serve la macchina funziona con i dati storici                                                                                                                                                                                              </td><td>Verificare connessione sonda evaporatore alla scheda, verificare se cubetti di ghiaccio sono accumulati nella zona evaporatore, verificare se valore in ohm letto è corretto, sostituire sonda.                                                                            </td></tr>\n<tr><td>(AL09) Blackout - Mancanza alimentazione elettrica </td><td>La macchina riprenderà a funzionare nello stato precedente all&#x27;interruzione di corrente.                                                                                                                                                                                                                    </td><td>&quot;Verificare connessioni elettriche e fonte di alimentazione. (Per togliere segnalazione allarme, tocco singolo per tacitare buzzer secondo tocco per togliere la segnalazione se si è dentro il primo minuto, solo il secondo tocco se è già passato il minuto).      </td></tr>\n</tbody>\n</table>', 'languages': ['ita'], 'parent_id': '11ce6f88f40e0741e4bb8728f00c7979', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'Table', 'element_id': '7308fdb665a3553d32051c2b93c5693a', 'text': "Allarme Stato Macchina Soluzione (AL10) Allarme alta Pressione La macchina si ferma, il ventilatore condensatore rimane acceso per ab- bassare la temperatura condensatore, o la valvola acqua rimane aperta in caso di condensazione ad acqua. (una volta raffreddata la macchina riparte facendo alcuni tentativi per vedere se l'allarme è passato, dopodiché si blocca definitiva- mente) Controllare pulizia e areazione condensatore, verificare se ventilatore condensatore gira, verificare posizione sonda condensatore, nelle versioni condensate ad acqua verificare alimentazione idrica e funzionalità valvola ingresso acqua, sostituire pressostato di massima. (AL11) Allarme Pompa scarico Macchina si ferma e periodicamente, per un numero limitato di tentativi, tenta di scaricare acqua Verificare che la linea di scarico acqua non sia ostruita, verificare funzionamento pompa di scarico, verificare pulizia sensore di livello, verificare uscite vaschetta di scarico, (AL12) Allarme sbrina- mento lungo Macchina si ferma dopo un numero di sbrinamenti consecutivi lunghi. Verificare assenza accumuli di ghiaccio su bacinella, verificare funzionamento motoriduttore ribaltamento e palette, verificare funzionalità micro ribaltamento, verificare cablaggio micro ribaltamento, verificare perdite gas, verificare valvola gas caldo (AL14) Pulizia condensatore Macchina continua a funzionare Consigliabile effettuare pulizia filtro aria o condensatore, o nel caso di versione condensata ad acqua, verificare se l'alimentazione idrica è sufficiente oppure troppo calda (AL15) Inversione sonde Macchina si ferma Verificare cablaggio su scheda delle sonde, eventualmente scambiarle o sostituirle (AL17) Alta T° Evaporatore Macchina si ferma Verificare posizione e isolamento sonda evaporato- re, verificare assenza perdite gas, verificare pulizia condensatore e funzionamento ventilatore, nel caso di condensazione ad acqua verificare alimentazione idrica e temperatura acqua.", 'metadata': {'last_modified': '2024-03-04T08:54:58', 'text_as_html': '<table>\n<thead>\n<tr><th>Allarme                           </th><th>Stato Macchina                                                                                                                                                                                                                                                                                                                     </th><th>Soluzione                                                                                                                                                                                                                                                                       </th></tr>\n</thead>\n<tbody>\n<tr><td>(AL10) Allarme alta Pressione     </td><td>La macchina si ferma, il ventilatore condensatore rimane acceso per ab- bassare la temperatura condensatore, o la valvola acqua rimane aperta in caso di condensazione ad acqua. (una volta raffreddata la macchina riparte facendo alcuni tentativi per vedere se l&#x27;allarme è passato, dopodiché si blocca definitiva- mente)</td><td>Controllare pulizia e areazione condensatore, verificare se ventilatore condensatore gira, verificare posizione sonda condensatore, nelle versioni condensate ad acqua verificare alimentazione idrica e funzionalità valvola ingresso acqua, sostituire pressostato di massima.</td></tr>\n<tr><td>(AL11) Allarme Pompa scarico      </td><td>Macchina si ferma e periodicamente, per un numero limitato di tentativi, tenta di scaricare acqua                                                                                                                                                                                                                                  </td><td>Verificare che la linea di scarico acqua non sia ostruita, verificare funzionamento pompa di scarico, verificare pulizia sensore di livello, verificare uscite vaschetta di scarico,                                                                                            </td></tr>\n<tr><td>(AL12) Allarme sbrina- mento lungo</td><td>Macchina si ferma dopo un numero di sbrinamenti consecutivi lunghi.                                                                                                                                                                                                                                                                </td><td>Verificare assenza accumuli di ghiaccio su bacinella, verificare funzionamento motoriduttore ribaltamento e palette, verificare funzionalità micro ribaltamento, verificare cablaggio micro ribaltamento, verificare perdite gas, verificare valvola gas caldo                  </td></tr>\n<tr><td>(AL14) Pulizia condensatore       </td><td>Macchina continua a funzionare                                                                                                                                                                                                                                                                                                     </td><td>Consigliabile effettuare pulizia filtro aria o condensatore, o nel caso di versione condensata ad acqua, verificare se l&#x27;alimentazione idrica è sufficiente oppure troppo calda                                                                                            </td></tr>\n<tr><td>(AL15) Inversione sonde           </td><td>Macchina si ferma                                                                                                                                                                                                                                                                                                                  </td><td>Verificare cablaggio su scheda delle sonde, eventualmente scambiarle o sostituirle                                                                                                                                                                                              </td></tr>\n<tr><td>(AL17) Alta T° Evaporatore        </td><td>Macchina si ferma                                                                                                                                                                                                                                                                                                                  </td><td>Verificare posizione e isolamento sonda evaporato- re, verificare assenza perdite gas, verificare pulizia condensatore e funzionamento ventilatore, nel caso di condensazione ad acqua verificare alimentazione idrica e temperatura acqua.                                     </td></tr>\n</tbody>\n</table>', 'languages': ['ita'], 'parent_id': '11ce6f88f40e0741e4bb8728f00c7979', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
