{'type': 'NarrativeText', 'element_id': '839194f550cb5b10ebb15a1a7e38f4db', 'text': 'Una volta rispettate le condizioni riportate al paragrafo 1.1, si può procede al collegamento alla APP di uno o più produttori di ghiaccio.', 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '2725b802b48852d41319b5733429ef53', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
