{'type': 'NarrativeText', 'element_id': 'db232fd083cb33552cb4b91e84ad740f', 'text': 'Per ripristinare il nome originario del mac address, basterà entrare in modifica, cancellare totalmente il nome esistente e successivamente salvare. In auto- matico verrà ripristinato il nome originale.', 'metadata': {'category_depth': 0, 'emphasized_text_contents': ['Per ripristinare il nome originario del mac address, basterà entrare in modifica, cancellare totalmente il nome esistente e successivamente salvare. In auto- matico verrà ripristinato il nome originale.', 'Per ripristinare il nome originario del mac address, basterà entrare in modifica, cancellare totalmente il nome esistente e successivamente salvare. In auto- matico verrà ripristinato il nome originale.'], 'emphasized_text_tags': ['b', 'i'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': 'cdea8af3e86b79f76a15d21bfd4dab31', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'NarrativeText', 'element_id': '1209d02256d2f0a465d9fb3808865c14', 'text': "Nel caso si voglia personalizzare il nome dell'apparec- chiatura, si può modificare il testo mac address, che viene dato in automatico come primo nome. Per entrare in fase di modifica premere il simbolo matita (46) , comparirà la tastiera con cui potrete modificare il nome (47).", 'metadata': {'category_depth': 0, 'emphasized_text_contents': ['(46)', '(47)'], 'emphasized_text_tags': ['b', 'b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': 'cdea8af3e86b79f76a15d21bfd4dab31', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
