{'type': 'NarrativeText', 'element_id': '8486d9f79401a9952b3cf80c2d4c0644', 'text': "Per ogni allarme si potrà accedere ad una videata che de- scrive l'allarme, le cause e le soluzioni possibili al problema, basterà premere sopra l'allarme interessato (47).", 'metadata': {'category_depth': 0, 'emphasized_text_contents': ['(47)'], 'emphasized_text_tags': ['b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '47f5ffc87c8edd0fb5b37c3909e45d8b', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'NarrativeText', 'element_id': '89406b8fc760801d86d369f6f2cc2855', 'text': 'Per cancellare gli allarmi trascorsi e non attivi si potrà premere il simbolo (48). apparirà la videata di fig.2a, che rappresenterà un conto alla rovescia, che se non ferma- to premendo su "Undo", porterà alla lista di allarmi storici vuota di fig. 2b.', 'metadata': {'category_depth': 0, 'emphasized_text_contents': ['(48)'], 'emphasized_text_tags': ['b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '47f5ffc87c8edd0fb5b37c3909e45d8b', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'NarrativeText', 'element_id': '193d07577fe83c606e1a9daa9a634321', 'text': 'Si passerà ad una videata che elencherà gli allarmi recenti attivi o cessati. Se non ci sono allarmi la lista sarà vuota.', 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '47f5ffc87c8edd0fb5b37c3909e45d8b', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
