{'type': 'NarrativeText', 'element_id': 'f7fbc2b7aeb73fc0ff5fc99baf547fc4', 'text': 'Verranno inizialmente visualizzati i valori letti dagli ingressi della scheda, per accedere ai valori delle uscite della scheda premere la voce (53).', 'metadata': {'category_depth': 0, 'emphasized_text_contents': ['(53)'], 'emphasized_text_tags': ['b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': 'a2dd0695384aa5fab7dc63b56f35c014', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
