{'type': 'UncategorizedText', 'element_id': 'b45122b5708447daefba7c8fe96555c6', 'text': "Nel caso si voglia visualizzare l'andamento delle tempera- ture delle sonde installate nella macchina, premere il tasto (76).", 'metadata': {'category_depth': 0, 'emphasized_text_contents': ['(76)'], 'emphasized_text_tags': ['b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '6dc6b01a6012978bb1b47c866bcea52f', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
