{'type': 'NarrativeText', 'element_id': '813b81fab85a955fa5d3920cbc47adad', 'text': "Al termine del ciclo di sbrinamento comparirà l'avviso se- guente.", 'metadata': {'category_depth': 0, 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '6dc6b01a6012978bb1b47c866bcea52f', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
{'type': 'NarrativeText', 'element_id': 'd79307342dae64db0b27c801243813ef', 'text': "Apparirà il seguente grafico , che rappresenterà l'anda- mento del grafico dal momento dell'attivazione. Per uscire premere il tasto (77).", 'metadata': {'category_depth': 0, 'emphasized_text_contents': ['(77)'], 'emphasized_text_tags': ['b'], 'last_modified': '2024-03-04T08:54:58', 'languages': ['ita'], 'parent_id': '6dc6b01a6012978bb1b47c866bcea52f', 'file_directory': 'pyqt_project/utils', 'filename': 'file.docx', 'filetype': 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'}}
